} impl ProvideCredentials for MyCustomProvider { fn provide_credentials<'a>(&'a self) -> future::ProvideCredentials<'a> where Self: 'a, { future::ProvideCredentials::new(self.load_credentials()) }
} Hint: If your credential provider is not asynchronous, you can use ProvideCredentials::ready instead to save an allocation. After writing your custom provider, you'll use it in when constructing the configuration: #[tokio::main]
