Fluent clients currently keep a handle to a single Smithy client, which is a wrapper around the underlying connector. When constructing operation builders, this handle is Arc cloned and given to the new builder instances so that their send() calls can initiate a request. The generated fluent client code ends up looking like this: struct Handle<C, M, R> { client: aws_smithy_client::Client<C, M, R>, conf: crate::Config,
} pub struct Client<C, M, R = Standard> { handle: Arc<Handle<C, M, R>>,
} Functions are generated per operation on the fluent client to gain access to the individual operation builders. For example: pub fn assume_role(&self) -> fluent_builders::AssumeRole<C, M, R> { fluent_builders::AssumeRole::new(self.handle.clone())
} The fluent operation builders ultimately implement send(), which chooses the one and only Smithy client out of the handle to make the request with: pub struct AssumeRole<C, M, R> { handle: std::sync::Arc<super::Handle<C, M, R>>, inner: crate::input::assume_role_input::Builder,
} impl<C, M, R> AssumeRole<C, M, R> where ...{ pub async fn send(self) -> Result<AssumeRoleOutput, SdkError<AssumeRoleError>> where ... { // Setup code omitted ... // Make the actual request self.handle.client.call(op).await }
} Smithy clients are constructed from a connector, as shown: let connector = Builder::new() .https() .middleware(...) .build();
let client = Client::with_config(connector, Config::builder().build()); The https() method on the Builder constructs the actual Hyper client, and is driven off Cargo features to select the correct TLS implementation. For example: #[cfg(feature = "rustls")]
pub fn https() -> Https { let https = hyper_rustls::HttpsConnector::with_native_roots(); let client = hyper::Client::builder().build::<_, SdkBody>(https); // HyperAdapter is a Tower `Service` request -> response connector that just calls the Hyper client crate::hyper_impls::HyperAdapter::from(client)
}

