Customers need to be able to provide HTTP settings, such as timeouts, for all connectors that the clients use. These should come out of the SharedConfig when it is used. Connector creation also needs to be customizable so that alternate HTTP implementations can be used, or so that a fake implementation can be used for tests. To accomplish this, SharedConfig will have a make_connector member. A customer would configure it as such: let config = some_shared_config_loader() .with_http_settings(my_http_settings) .with_make_connector(|reqs: &MakeConnectorRequirements| { Some(MyCustomConnector::new(reqs)) }) .await; The passed in MakeConnectorRequirements will hold the customer-provided HttpSettings as well as any Smithy-modeled requirements, which will just be HttpVersion for now. The MakeConnectorRequirements struct will be marked non_exhaustive so that new requirements can be added to it as the SDK evolves. A default make_connector implementation would be provided that creates a Hyper connector based on the Cargo feature flags. This might look something like this: #[cfg(feature = "rustls")]
pub fn default_connector(reqs: &HttpRequirements) -> HyperAdapter { let https = hyper_rustls::HttpsConnector::with_native_roots(); let mut builder = hyper::Client::builder(); builder = configure_settings(builder, &reqs.http_settings); if let Http2 = &reqs.http_version { builder = builder.http2_only(true); } HyperAdapter::from(builder.build::<_, SdkBody>(https))
} For any given service, make_connector could be called multiple times to create connectors for all required HTTP versions and settings. Note: the make_connector returns an Option since an HTTP version may not be required, but rather, preferred according to a Smithy model. For operations that list out ["h2", "HTTP/1.1"] as the desired versions, a customer could choose to provide only an HTTP 1 connector, and the operation should still succeed.

