Each service operation needs to be able to select a connector that meets its requirements best from the customer provided connectors. Initially, the only selection criteria will be the HTTP version, but later when per-operation HTTP settings are implemented, the connector will also need to be keyed off of those settings. Since connector creation is not a cheap process, connectors will need to be cached after they are created. This caching is currently handled by the Handle in the fluent client, which holds on to the Smithy client. This cache needs to be adjusted to: Support multiple connectors, keyed off of the customer provided HttpSettings, and also off of the Smithy modeled requirements. Be lazy initialized. Services that have a mix of Event Stream and non-streaming operations shouldn't create an HTTP/2 client if the customer doesn't intend to use the Event Stream operations that require it. To accomplish this, the Handle will hold a cache that is optimized for many reads and few writes: #[derive(Debug, Hash, Eq, PartialEq)]
struct ConnectorKey { http_settings: HttpSettings, http_version: HttpVersion,
} struct Handle<C, M, R> { clients: RwLock<HashMap<HttpRequirements<'static>, aws_smithy_client::Client<C, M, R>>>, conf: crate::Config,
} pub struct Client<C, M, R = Standard> { handle: Arc<Handle<C, M, R>>,
} With how the generics are organized, the connector type will have to be the same between HTTP implementations, but this should be fine since it is generally a thin wrapper around a separate HTTP implementor. For cases where it is not, the custom connector type can host its own dyn Trait solution. The HttpRequirements struct will hold HttpSettings as copy-on-write so that it can be used for cache lookup without having to clone HttpSettings: struct HttpRequirements<'a> { http_settings: Cow<'a, HttpSettings>, http_version: HttpVersion,
} impl<'a> HttpRequirements<'a> { // Needed for converting a borrowed HttpRequirements into an owned cache key for cache population pub fn into_owned(self) -> HttpRequirements<'static> { Self { http_settings: Cow::Owned(self.http_settings.into_owned()), http_version: self.http_version, } }
} With the cache established, each operation needs to be aware of its requirements. The code generator will be updated to store a prioritized list of HttpVersion in the property bag in an input's make_operation() method. This prioritized list will come from the Smithy protocol trait's http or eventStreamHttp attribute, depending on the operation. The fluent client will then pull this list out of the property bag so that it can determine which connector to use. This indirection is necessary so that an operation still holds all information needed to make a service call from the Smithy client directly. Note: This may be extended in the future to be more than just HttpVersion, for example, when per-operation HTTP setting overrides are implemented. This doc is not attempting to solve that problem. In the fluent client, this will look as follows: impl<C, M, R> AssumeRole<C, M, R> where ... { pub async fn send(self) -> Result<AssumeRoleOutput, SdkError<AssumeRoleError>> where ... { let input = self.create_input()?; let op = input.make_operation(&self.handle.conf)?; // Grab the `make_connector` implementation let make_connector = self.config.make_connector(); // Acquire the prioritized HttpVersion list let http_versions = op.properties().get::<HttpVersionList>(); // Make the actual request (using default HttpSettings until modifying those is implemented) let client = self.handle .get_or_create_client(make_connector, &default_http_settings(), &http_versions) .await?; client.call(op).await }
} If an operation requires a specific protocol version, and if the make_connection implementation can't provide that it, then the get_or_create_client() function will return SdkError::ConstructionFailure indicating the error.

