Today, presigned URLs take an expiration time that's not part of the service API. The SDK will make this configurable as a separate struct so that there's no chance of name collisions, and so that additional fields can be added in the future. Fields added later will require defaulting for backwards compatibility. Customers should also be able to set a start time on the presigned URL's expiration so that they can generate URLs that become active in the future. An optional start_time option will be available and default to SystemTime::now(). Construction PresigningConfig can be done with a builder, but a PresigningConfig::expires_in convenience function will be provided to bypass the builder for the most frequent use-case. #[non_exhaustive]
#[derive(Debug, Clone)]
pub struct PresigningConfig { start_time: SystemTime, expires_in: Duration,
} #[non_exhaustive]
#[derive(Debug)]
pub struct Builder { start_time: Option<SystemTime>, expires_in: Option<Duration>,
} impl Builder { pub fn start_time(self, start_time: SystemTime) -> Self { ... } pub fn set_start_time(&mut self, start_time: Option<SystemTime>) { ... } pub fn expires_in(self, expires_in: Duration) -> Self { ... } pub fn set_expires_in(&mut self, expires_in: Option<Duration>) { ... } // Validates `expires_in` is no greater than one week pub fn build(self) -> Result<PresigningConfig, Error> { ... }
} impl PresigningConfig { pub fn expires_in(expires_in: Duration) -> PresigningConfig { Self::builder().expires(expires).build().unwrap() } pub fn builder() -> Builder { ... }
} Construction of PresigningConfig will validate that expires_in is no greater than one week, as this is the longest supported expiration time for SigV4. This validation will result in a panic. It's not inconceivable that PresigningConfig will need additional service-specific parameters as customizations, so it will be code generated with each service rather than living a shared location.

