Paginators will be generated into the paginator module of service crates. Currently, paginators are not feature gated, but this could be considered in the future. A paginator struct captures 2 pieces of data: // dynamodb/src/paginator.rs
struct ListTablesPaginator<C, M, R> { // holds the low-level client and configuration handle: Arc<Handle<C, M, R>>, // input builder to construct the actual input on demand input: ListTablesInputBuilder
} In addition to the basic usage example above, when pageSize is modeled, customers can specify the page size during pagination: let mut tables = vec![];
let mut pages = client .list_tables() .paginate() .page_size(20) .send();
while let Some(next_page) = pages.try_next().await? { // pages of 20 items requested from DynamoDb tables.extend(next_page.table_names.unwrap_or_default().into_iter());
} Paginators define a public method send(). This method returns impl Stream<Item=Result<OperationOutput, OperationError>. This uses FnStream defined in the aws-smithy-async crate which enables demand driven execution of a closure. A rendezvous channel is used which will block on send until demand exists. When modeled by Smithy, page_size which automatically sets the appropriate page_size parameter and items() which returns an automatically flattened paginator are also generated. Note : page_size directly sets the modeled parameter on the internal builder. This means that a value set for page size will override any previously set value for that field. // Generated paginator for ListTables
impl<C, M, R> ListTablesPaginator<C, M, R>
{ /// Set the page size pub fn page_size(mut self, limit: i32) -> Self { self.builder.limit = Some(limit); self } /// Create a flattened paginator /// /// This paginator automatically flattens results using `table_names`. Queries to the underlying service /// are dispatched lazily. pub fn items(self) -> crate::paginator::ListTablesPaginatorItems<C, M, R> { crate::paginator::ListTablesPaginatorItems(self) } /// Create the pagination stream /// /// _Note:_ No requests will be dispatched until the stream is used (eg. with [`.next().await`](tokio_stream::StreamExt::next)). pub async fn send( self, ) -> impl tokio_stream::Stream< Item = std::result::Result< crate::output::ListTablesOutput, aws_smithy_http::result::SdkError<crate::error::ListTablesError>, >, > + Unpin { // Move individual fields out of self for the borrow checker let builder = self.builder; let handle = self.handle; fn_stream::FnStream::new(move |tx| { Box::pin(async move { // Build the input for the first time. If required fields are missing, this is where we'll produce an early error. let mut input = match builder.build().map_err(|err| { SdkError::ConstructionFailure(err.into()) }) { Ok(input) => input, Err(e) => { let _ = tx.send(Err(e)).await; return; } }; loop { let op = match input.make_operation(&handle.conf).await.map_err(|err| { SdkError::ConstructionFailure(err.into()) }) { Ok(op) => op, Err(e) => { let _ = tx.send(Err(e)).await; return; } }; let resp = handle.client.call(op).await; // If the input member is None or it was an error let done = match resp { Ok(ref resp) => { input.exclusive_start_table_name = crate::lens::reflens_structure_crate_output_list_tables_output_last_evaluated_table_name(resp).cloned(); input.exclusive_start_table_name.is_none() } Err(_) => true, }; if let Err(_) = tx.send(resp).await { // receiving end was dropped return; } if done { return; } } }) }) }
} On Box::pin : The stream returned by AsyncStream does not implement Unpin. Unfortunately, this makes iteration require an invocation of pin_mut! and generates several hundred lines of compiler errors. Box::pin seems a worthwhile trade off to improve the user experience. On the + Unpin bound : Because auto-traits leak across impl Trait boundaries, + Unpin prevents accidental regressions in the generated code which would break users. On the crate::reflens::... : We use LensGenerator.kt to generate potentially complex accessors to deeply nested fields.

