Status: Accepted Waiters are a convenient polling mechanism to wait for a resource to become available or to be deleted. For example, a waiter could be used to wait for a S3 bucket to be created after a call to the CreateBucket API, and this would only require a small amount of code rather than building out an entire polling mechanism manually. At the highest level, a waiter is a simple polling loop (pseudo-Rust): // Track state that contains the number of attempts made and the previous delay
let mut state = initial_state(); loop { // Poll the service let result = poll_service().await; // Classify the action that needs to be taken based on the Smithy model match classify(result) { // If max attempts hasn't been exceeded, then retry after a delay. Otherwise, error. Retry => if state.should_retry() { let delay = state.next_retry(); sleep(delay).await; } else { return error_max_attempts(); } // Otherwise, if the termination condition was met, return the output Terminate(result) => return result, }
} In the AWS SDK for Rust, waiters can be added without making any backwards breaking changes to the current API. This doc outlines the approach to add them in this fashion, but does NOT examine code generating response classification from JMESPath expressions, which can be left to the implementer without concern for the overall API.

