To invoke a waiter, customers will only need to invoke a single function on the AWS Client. For example, if waiting for a S3 bucket to exist, it would look like the following: // Request bucket creation
client.create_bucket() .bucket_name("my-bucket") .send() .await()?; // Wait for it to be created
client.wait_until_bucket_exists() .bucket_name("my-bucket") .send() .await?; The call to wait_until_bucket_exists() will return a waiter-specific fluent builder with a send() function that will start the polling and return a future. To avoid name conflicts with other API methods, the waiter functions can be added to the client via trait: pub trait WaitUntilBucketExists { fn wait_until_bucket_exists(&self) -> crate::waiter::bucket_exists::Builder;
} This trait would be implemented for the service's fluent client (which will necessitate making the fluent client's handle field pub(crate)).

