) -> Result<HeadBucketOutput, SdkError<HeadBucketError>> { loop { let operation = input .make_operation(&handle.conf) .await .map_err(|err| { aws_smithy_http::result::SdkError::ConstructionFailure(err.into()) })?; // Assume `ClassifyRetry` trait is implemented for `NeverRetry` to always return `RetryKind::Unnecessary` let operation = operation.with_retry_classifier(NeverRetry::new()); let result = handle.client.call(operation).await; match classify_result(&input, result) { AcceptorState::Retry => { // The sleep implementation is available here from `handle.conf.sleep_impl` unimplemented!("Check if another attempt should be made and calculate delay time if so") } AcceptorState::Terminate(output) => return output, } }
} fn classify_result( input: &HeadBucketInput, result: Result<HeadBucketOutput, SdkError<HeadBucketError>>,
) -> AcceptorState<HeadBucketOutput, SdkError<HeadBucketError>> { unimplemented!( "The Smithy model would dictate conditions to check here to produce an `AcceptorState`" )
