Note that comments starting with '//' are not necessarily going to be included in the actual implementation and are intended as clarifying comments for the purposes of this RFC. // in aws_smithy_http::callbacks... /// A callback that, when inserted into a request body, will be called for corresponding lifecycle events.
trait BodyCallback: Send { /// This lifecycle function is called for each chunk **successfully** read. If an error occurs while reading a chunk, /// this method will not be called. This method takes `&mut self` so that implementors may modify an implementing /// struct/enum's internal state. Implementors may return an error. fn update(&mut self, #[allow(unused_variables)] bytes: &[u8]) -> Result<(), BoxError> { Ok(()) } /// This callback is called once all chunks have been read. If the callback encountered one or more errors /// while running `update`s, this is how those errors are raised. Implementors may return a [`HeaderMap`][HeaderMap] /// that will be appended to the HTTP body as a trailer. This is only useful to do for streaming requests. fn trailers(&self) -> Result<Option<HeaderMap<HeaderValue>>, BoxError> { Ok(None) } /// Create a new `BodyCallback` from an existing one. This is called when a `BodyCallback` needs to be /// re-initialized with default state. For example: when a request has a body that needs to be /// rebuilt, all callbacks for that body need to be run again but with a fresh internal state. fn make_new(&self) -> Box<dyn BodyCallback>;
} impl BodyCallback for Box<dyn BodyCallback> { fn update(&mut self, bytes: &[u8]) -> Result<(), BoxError> { BodyCallback::update(self, bytes) } fn trailers(&self) -> Result<Option<HeaderMap<HeaderValue>>, BoxError> { BodyCallback::trailers(self) } fn make_new(&self) -> Box<dyn SendCallback> { BodyCallback::make_new(self) }
