} impl Inner<SdkBody> { // `Inner` wraps an `SdkBody` which has a "builder-style" function for adding callbacks. pub fn with_body_callback(&mut self, body_callback: Box<dyn BodyCallback>) -> &mut Self { self.body.with_body_callback(body_callback); self }
