/// left_hand_side_headers.insert(
/// header_name.clone(),
/// HeaderValue::from_str("lhs value").unwrap(),
/// );
///
/// let mut right_hand_side_headers = HeaderMap::new();
/// right_hand_side_headers.insert(
/// header_name.clone(),
/// HeaderValue::from_str("rhs value").unwrap(),
/// );
///
/// let merged_header_map =
/// append_merge_header_maps(left_hand_side_headers, right_hand_side_headers);
/// let merged_values: Vec<_> = merged_header_map
/// .get_all(header_name.clone())
/// .into_iter()
/// .collect();
///
/// // Will print 'some_key: ["lhs value", "rhs value"]'
/// println!("{}: {:?}", header_name.as_str(), merged_values);
/// ```
fn append_merge_header_maps( mut lhs: HeaderMap<HeaderValue>, rhs: HeaderMap<HeaderValue>,
) -> HeaderMap<HeaderValue> { let mut last_header_name_seen = None; for (header_name, header_value) in rhs.into_iter() { // For each yielded item that has None provided for the `HeaderName`, // then the associated header name is the same as that of the previously // yielded item. The first yielded item will have `HeaderName` set. // https://docs.rs/http/latest/http/header/struct.HeaderMap.html#method.into_iter-2 match (&mut last_header_name_seen, header_name) { (_, Some(header_name)) => { lhs.append(header_name.clone(), header_value); last_header_name_seen = Some(header_name); } (Some(header_name), None) => { lhs.append(header_name.clone(), header_value); } (None, None) => unreachable!(), }; } lhs
} impl http_body::Body for SdkBody { // The other methods have been omitted because they haven't changed fn poll_trailers( self: Pin<&mut Self>, _cx: &mut Context<'_>, ) -> Poll<Result<Option<HeaderMap<HeaderValue>>, Self::Error>> { let header_map = self .callbacks .iter() .filter_map(|callback| { match callback.trailers() { Ok(optional_header_map) => optional_header_map, // early return if a callback encountered an error Err(e) => { return e }, } }) // Merge any `HeaderMap`s from the last step together, one by one. .reduce(append_merge_header_maps); Poll::Ready(Ok(header_map)) }
}

