What follows is a simplified example of how this API could be used to introduce checksum validation for outgoing request payloads. In this example, the checksum calculation is fallible and no validation takes place. All it does it calculate the checksum of some data and then returns the checksum of that data when trailers is called. This is fine because it's being used to calculate the checksum of a streaming body for a request. #[derive(Default)]
struct Crc32cChecksumCallback { state: Option<u32>,
} impl ReadCallback for Crc32cChecksumCallback { fn update(&mut self, bytes: &[u8]) -> Result<(), BoxError> { self.state = match self.state { Some(crc) => { self.state = Some(crc32c_append(crc, bytes)) } None => { Some(crc32c(&bytes)) } }; Ok(()) } fn trailers(&self) -> Result<Option<HeaderMap<HeaderValue>>, Box<dyn std::error::Error + Send + Sync>> { let mut header_map = HeaderMap::new(); // This checksum name is an Amazon standard and would be a `const` in the real implementation let key = HeaderName::from_static("x-amz-checksum-crc32c"); // If no data was provided to this callback and no CRC was ever calculated, we return zero as the checksum. let crc = self.state.unwrap_or_default(); // Convert the CRC to a string, base 64 encode it, and then convert it into a `HeaderValue`. let value = HeaderValue::from_str(&base64::encode(crc.to_string())).expect("base64 will always produce valid header values"); header_map.insert(key, value); Some(header_map) } fn make_new(&self) -> Box<dyn ReadCallback> { Box::new(Crc32cChecksumCallback::default()) }
} NOTE: If Crc32cChecksumCallback needed to validate a response, then we could modify it to check its internal state against a target checksum value and calling trailers would produce an error if the values didn't match. In order to use this in a request, we'd modify codegen for that request's service. We'd check if the user had requested validation and also check if they'd pre-calculated a checksum. If validation was requested but no pre-calculated checksum was given, we'd create a callback similar to the one above Then, we'd create a new checksum callback and: (if streaming) we'd set the checksum callback on the request body object (if non-streaming) we'd immediately read the body and call BodyCallback::update manually. Once all data was read, we'd get the checksum by calling trailers and insert that data as a request header.

