TLDR; This refactor of aws-smithy-checksums: Removes the "callback" terminology: As a word, "callback" doesn't carry any useful information, and doesn't aid in understanding. Removes support for the BodyCallback API: Instead of adding checksum callbacks to a body, we're going to use a "body wrapping" instead. "Body wrapping" is demonstrated in the ChecksumBody , AwsChunkedBody , and ChecksumValidatedBody sections. NOTE: This doesn't remove the BodyCallback trait. That will still exist, we just won't use it. Updates terminology to focus on "headers" instead of "trailers": Because the types we deal with in this module are named for HTTP headers, I chose to use that terminology instead. My hope is that this will be less strange to people reading this code. Adds fn checksum_algorithm_to_checksum_header_name: a function that's used in generated code to set a checksum request header. Adds fn checksum_header_name_to_checksum_algorithm: a function that's used in generated code when creating a checksum-validating response body. Add new checksum-related "body wrapping" HTTP body types : These are defined in the body module and will be shown later in this RFC. // In aws-smithy-checksums/src/lib.rs
//! Checksum calculation and verification callbacks use aws_smithy_types::base64; use bytes::Bytes;
use http::header::{HeaderMap, HeaderName, HeaderValue};
use sha1::Digest;
use std::io::Write; pub mod body; // Valid checksum algorithm names
pub const CRC_32_NAME: &str = "crc32";
pub const CRC_32_C_NAME: &str = "crc32c";
pub const SHA_1_NAME: &str = "sha1";
pub const SHA_256_NAME: &str = "sha256"; pub const CRC_32_HEADER_NAME: HeaderName = HeaderName::from_static("x-amz-checksum-crc32");
pub const CRC_32_C_HEADER_NAME: HeaderName = HeaderName::from_static("x-amz-checksum-crc32c");
pub const SHA_1_HEADER_NAME: HeaderName = HeaderName::from_static("x-amz-checksum-sha1");
pub const SHA_256_HEADER_NAME: HeaderName = HeaderName::from_static("x-amz-checksum-sha256"); // Preserved for compatibility purposes. This should never be used by users, only within smithy-rs
const MD5_NAME: &str = "md5";
const MD5_HEADER_NAME: HeaderName = HeaderName::from_static("content-md5"); /// Given a `&str` representing a checksum algorithm, return the corresponding `HeaderName`
/// for that checksum algorithm.
pub fn checksum_algorithm_to_checksum_header_name(checksum_algorithm: &str) -> HeaderName { if checksum_algorithm.eq_ignore_ascii_case(CRC_32_NAME) { CRC_32_HEADER_NAME } else if checksum_algorithm.eq_ignore_ascii_case(CRC_32_C_NAME) { CRC_32_C_HEADER_NAME } else if checksum_algorithm.eq_ignore_ascii_case(SHA_1_NAME) { SHA_1_HEADER_NAME } else if checksum_algorithm.eq_ignore_ascii_case(SHA_256_NAME) { SHA_256_HEADER_NAME } else if checksum_algorithm.eq_ignore_ascii_case(MD5_NAME) { MD5_HEADER_NAME } else { // TODO what's the best way to handle this case? HeaderName::from_static("x-amz-checksum-unknown") }
} /// Given a `HeaderName` representing a checksum algorithm, return the name of that algorithm
/// as a `&'static str`.
pub fn checksum_header_name_to_checksum_algorithm( checksum_header_name: &HeaderName,
) -> &'static str { if checksum_header_name == CRC_32_HEADER_NAME { CRC_32_NAME } else if checksum_header_name == CRC_32_C_HEADER_NAME { CRC_32_C_NAME } else if checksum_header_name == SHA_1_HEADER_NAME { SHA_1_NAME } else if checksum_header_name == SHA_256_HEADER_NAME { SHA_256_NAME } else if checksum_header_name == MD5_HEADER_NAME { MD5_NAME } else { // TODO what's the best way to handle this case? "unknown-checksum-algorithm" }
} /// When a response has to be checksum-verified, we have to check possible headers until we find the
/// header with the precalculated checksum. Because a service may send back multiple headers, we have
/// to check them in order based on how fast each checksum is to calculate.
pub const CHECKSUM_HEADERS_IN_PRIORITY_ORDER: [HeaderName; 4] = [ CRC_32_C_HEADER_NAME, CRC_32_HEADER_NAME, SHA_1_HEADER_NAME, SHA_256_HEADER_NAME,
]; type BoxError = Box<dyn std::error::Error + Send + Sync>; /// Checksum algorithms are use to validate the integrity of data. Structs that implement this trait
/// can be used as checksum calculators. This trait requires Send + Sync because these checksums are
/// often used in a threaded context.
pub trait Checksum: Send + Sync { /// Given a slice of bytes, update this checksum's internal state. fn update(&mut self, bytes: &[u8]) -> Result<(), BoxError>; /// Either return this checksum as a `HeaderMap` containing one HTTP header, or return an error /// describing why checksum calculation failed. fn headers(&self) -> Result<Option<HeaderMap<HeaderValue>>, BoxError>; /// Return the `HeaderName` used to represent this checksum algorithm fn header_name(&self) -> HeaderName; /// "Finalize" this checksum, returning the calculated value as `Bytes` or an error that /// occurred during checksum calculation. To print this value in a human-readable hexadecimal /// format, you can print it using Rust's builtin [formatter]. /// /// _**NOTE:** typically, "finalizing" a checksum in Rust will take ownership of the checksum /// struct. In this method, we clone the checksum's state before finalizing because checksums /// may be used in a situation where taking ownership is not possible._ /// /// [formatter]: https://doc.rust-lang.org/std/fmt/trait.UpperHex.html fn finalize(&self) -> Result<Bytes, BoxError>; /// Return the size of this checksum algorithms resulting checksum, in bytes. For example, the /// CRC32 checksum algorithm calculates a 32 bit checksum, so a CRC32 checksum struct /// implementing this trait method would return 4. fn size(&self) -> u64;
} /// Create a new `Box<dyn Checksum>` from an algorithm name. Valid algorithm names are defined as
/// `const`s in this module.
pub fn new_checksum(checksum_algorithm: &str) -> Box<dyn Checksum> { if checksum_algorithm.eq_ignore_ascii_case(CRC_32_NAME) { Box::new(Crc32::default()) } else if checksum_algorithm.eq_ignore_ascii_case(CRC_32_C_NAME) { Box::new(Crc32c::default()) } else if checksum_algorithm.eq_ignore_ascii_case(SHA_1_NAME) { Box::new(Sha1::default()) } else if checksum_algorithm.eq_ignore_ascii_case(SHA_256_NAME) { Box::new(Sha256::default()) } else if checksum_algorithm.eq_ignore_ascii_case(MD5_NAME) { // It's possible to create an MD5 and we do this in some situations for compatibility. // We deliberately hide this from users so that they don't go using it. Box::new(Md5::default()) } else { panic!("unsupported checksum algorithm '{}'", checksum_algorithm) }
} #[derive(Debug, Default)]
struct Crc32 { hasher: crc32fast::Hasher,
} impl Crc32 { fn update(&mut self, bytes: &[u8]) -> Result<(), BoxError> { self.hasher.update(bytes); Ok(()) } fn headers(&self) -> Result<Option<HeaderMap<HeaderValue>>, BoxError> { let mut header_map = HeaderMap::new(); header_map.insert(Self::header_name(), self.header_value()); Ok(Some(header_map)) } fn finalize(&self) -> Result<Bytes, BoxError> { Ok(Bytes::copy_from_slice( &self.hasher.clone().finalize().to_be_bytes(), )) } // Size of the checksum in bytes fn size() -> u64 { 4 } fn header_name() -> HeaderName { CRC_32_HEADER_NAME } fn header_value(&self) -> HeaderValue { // We clone the hasher because `Hasher::finalize` consumes `self` let hash = self.hasher.clone().finalize(); HeaderValue::from_str(&base64::encode(u32::to_be_bytes(hash))) .expect("will always produce a valid header value from a CRC32 checksum") }
} impl Checksum for Crc32 { fn update( &mut self, bytes: &[u8], ) -> Result<(), Box<(dyn std::error::Error + Send + Sync + 'static)>> { Self::update(self, bytes) } fn headers( &self, ) -> Result<Option<HeaderMap>, Box<(dyn std::error::Error + Send + Sync + 'static)>> { Self::headers(self) } fn header_name(&self) -> HeaderName { Self::header_name() } fn finalize(&self) -> Result<Bytes, BoxError> { Self::finalize(self) } fn size(&self) -> u64 { Self::size() }
} #[derive(Debug, Default)]
struct Crc32c { state: Option<u32>,
} impl Crc32c { fn update(&mut self, bytes: &[u8]) -> Result<(), BoxError> { self.state = match self.state { Some(crc) => Some(crc32c::crc32c_append(crc, bytes)), None => Some(crc32c::crc32c(bytes)), }; Ok(()) } fn headers(&self) -> Result<Option<HeaderMap<HeaderValue>>, BoxError> { let mut header_map = HeaderMap::new(); header_map.insert(Self::header_name(), self.header_value()); Ok(Some(header_map)) } fn finalize(&self) -> Result<Bytes, BoxError> { Ok(Bytes::copy_from_slice( &self.state.unwrap_or_default().to_be_bytes(), )) } // Size of the checksum in bytes fn size() -> u64 { 4 } fn header_name() -> HeaderName { CRC_32_C_HEADER_NAME } fn header_value(&self) -> HeaderValue { // If no data was provided to this callback and no CRC was ever calculated, return zero as the checksum. let hash = self.state.unwrap_or_default(); HeaderValue::from_str(&base64::encode(u32::to_be_bytes(hash))) .expect("will always produce a valid header value from a CRC32C checksum") }
} impl Checksum for Crc32c { fn update( &mut self, bytes: &[u8], ) -> Result<(), Box<(dyn std::error::Error + Send + Sync + 'static)>> { Self::update(self, bytes) } fn headers( &self, ) -> Result<Option<HeaderMap>, Box<(dyn std::error::Error + Send + Sync + 'static)>> { Self::headers(self) } fn header_name(&self) -> HeaderName { Self::header_name() } fn finalize(&self) -> Result<Bytes, BoxError> { Self::finalize(self) } fn size(&self) -> u64 { Self::size() }
} #[derive(Debug, Default)]
struct Sha1 { hasher: sha1::Sha1,
} impl Sha1 { fn update(&mut self, bytes: &[u8]) -> Result<(), BoxError> { self.hasher.write_all(bytes)?; Ok(()) } fn headers(&self) -> Result<Option<HeaderMap<HeaderValue>>, BoxError> { let mut header_map = HeaderMap::new(); header_map.insert(Self::header_name(), self.header_value()); Ok(Some(header_map)) } fn finalize(&self) -> Result<Bytes, BoxError> { Ok(Bytes::copy_from_slice( self.hasher.clone().finalize().as_slice(), )) } // Size of the checksum in bytes fn size() -> u64 { 20 } fn header_name() -> HeaderName { SHA_1_HEADER_NAME } fn header_value(&self) -> HeaderValue { // We clone the hasher because `Hasher::finalize` consumes `self` let hash = self.hasher.clone().finalize(); HeaderValue::from_str(&base64::encode(&hash[..])) .expect("will always produce a valid header value from a SHA-1 checksum") }
} impl Checksum for Sha1 { fn update( &mut self, bytes: &[u8], ) -> Result<(), Box<(dyn std::error::Error + Send + Sync + 'static)>> { Self::update(self, bytes) } fn headers( &self, ) -> Result<Option<HeaderMap>, Box<(dyn std::error::Error + Send + Sync + 'static)>> { Self::headers(self) } fn header_name(&self) -> HeaderName { Self::header_name() } fn finalize(&self) -> Result<Bytes, BoxError> { Self::finalize(self) } fn size(&self) -> u64 { Self::size() }
} #[derive(Debug, Default)]
struct Sha256 { hasher: sha2::Sha256,
} impl Sha256 { fn update(&mut self, bytes: &[u8]) -> Result<(), BoxError> { self.hasher.write_all(bytes)?; Ok(()) } fn headers(&self) -> Result<Option<HeaderMap<HeaderValue>>, BoxError> { let mut header_map = HeaderMap::new(); header_map.insert(Self::header_name(), self.header_value()); Ok(Some(header_map)) } fn finalize(&self) -> Result<Bytes, BoxError> { Ok(Bytes::copy_from_slice( self.hasher.clone().finalize().as_slice(), )) } // Size of the checksum in bytes fn size() -> u64 { 32 } fn header_name() -> HeaderName { SHA_256_HEADER_NAME } fn header_value(&self) -> HeaderValue { // We clone the hasher because `Hasher::finalize` consumes `self` let hash = self.hasher.clone().finalize(); HeaderValue::from_str(&base64::encode(&hash[..])) .expect("will always produce a valid header value from a SHA-256 checksum") }
} impl Checksum for Sha256 { fn update( &mut self, bytes: &[u8], ) -> Result<(), Box<(dyn std::error::Error + Send + Sync + 'static)>> { Self::update(self, bytes) } fn headers( &self, ) -> Result<Option<HeaderMap>, Box<(dyn std::error::Error + Send + Sync + 'static)>> { Self::headers(self) } fn header_name(&self) -> HeaderName { Self::header_name() } fn finalize(&self) -> Result<Bytes, BoxError> { Self::finalize(self) } fn size(&self) -> u64 { Self::size() }
} #[derive(Debug, Default)]
struct Md5 { hasher: md5::Md5,
} impl Md5 { fn update(&mut self, bytes: &[u8]) -> Result<(), BoxError> { self.hasher.write_all(bytes)?; Ok(()) } fn headers(&self) -> Result<Option<HeaderMap<HeaderValue>>, BoxError> { let mut header_map = HeaderMap::new(); header_map.insert(Self::header_name(), self.header_value()); Ok(Some(header_map)) } fn finalize(&self) -> Result<Bytes, BoxError> { Ok(Bytes::copy_from_slice( self.hasher.clone().finalize().as_slice(), )) } // Size of the checksum in bytes fn size() -> u64 { 16 } fn header_name() -> HeaderName { MD5_HEADER_NAME } fn header_value(&self) -> HeaderValue { // We clone the hasher because `Hasher::finalize` consumes `self` let hash = self.hasher.clone().finalize(); HeaderValue::from_str(&base64::encode(&hash[..])) .expect("will always produce a valid header value from an MD5 checksum") }
} impl Checksum for Md5 { fn update( &mut self, bytes: &[u8], ) -> Result<(), Box<(dyn std::error::Error + Send + Sync + 'static)>> { Self::update(self, bytes) } fn headers( &self, ) -> Result<Option<HeaderMap>, Box<(dyn std::error::Error + Send + Sync + 'static)>> { Self::headers(self) } fn header_name(&self) -> HeaderName { Self::header_name() } fn finalize(&self) -> Result<Bytes, BoxError> { Self::finalize(self) } fn size(&self) -> u64 { Self::size() }
} // We have existing tests for the checksums, those don't require an update

