When creating a checksum-validated request with an in-memory request body, we can read the body, calculate a checksum, and insert the checksum header, all before sending the request. When creating a checksum-validated request with a streaming request body, we don't have that luxury. Instead, we must calculate a checksum while sending the body, and append that checksum as a trailer . We will accomplish this by wrapping the SdkBody that requires validation within a ChecksumBody. Afterwards, we'll need to wrap the ChecksumBody in yet another layer which we'll discuss in the AwsChunkedBody and AwsChunkedBodyOptions section. // In aws-smithy-checksums/src/body.rs
use crate::{new_checksum, Checksum}; use aws_smithy_http::body::SdkBody;
use aws_smithy_http::header::append_merge_header_maps;
use aws_smithy_types::base64; use bytes::{Buf, Bytes};
use http::header::HeaderName;
use http::{HeaderMap, HeaderValue};
use http_body::{Body, SizeHint};
use pin_project::pin_project; use std::fmt::Display;
use std::pin::Pin;
use std::task::{Context, Poll}; /// A `ChecksumBody` will read and calculate a request body as it's being sent. Once the body has
/// been completely read, it'll append a trailer with the calculated checksum.
#[pin_project]
pub struct ChecksumBody<InnerBody> { #[pin] inner: InnerBody, #[pin] checksum: Box<dyn Checksum>,
} impl ChecksumBody<SdkBody> { /// Given an `SdkBody` and the name of a checksum algorithm as a `&str`, create a new /// `ChecksumBody<SdkBody>`. Valid checksum algorithm names are defined in this crate's /// [root module](super). /// /// # Panics /// /// This will panic if the given checksum algorithm is not supported. pub fn new(body: SdkBody, checksum_algorithm: &str) -> Self { Self { checksum: new_checksum(checksum_algorithm), inner: body, } } /// Return the name of the trailer that will be emitted by this `ChecksumBody` pub fn trailer_name(&self) -> HeaderName { self.checksum.header_name() } /// Calculate and return the sum of the: /// - checksum when base64 encoded /// - trailer name /// - trailer separator /// /// This is necessary for calculating the true size of the request body for certain /// content-encodings. pub fn trailer_length(&self) -> u64 { let trailer_name_size_in_bytes = self.checksum.header_name().as_str().len() as u64; let base64_encoded_checksum_size_in_bytes = base64::encoded_length(self.checksum.size()); (trailer_name_size_in_bytes // HTTP trailer names and values may be separated by either a single colon or a single // colon and a whitespace. In the AWS Rust SDK, we use a single colon. + ":".len() as u64 + base64_encoded_checksum_size_in_bytes) } fn poll_inner( self: Pin<&mut Self>, cx: &mut Context<'_>, ) -> Poll<Option<Result<Bytes, aws_smithy_http::body::Error>>> { let this = self.project(); let inner = this.inner; let mut checksum = this.checksum; match inner.poll_data(cx) { Poll::Ready(Some(Ok(mut data))) => { let len = data.chunk().len(); let bytes = data.copy_to_bytes(len); if let Err(e) = checksum.update(&bytes) { return Poll::Ready(Some(Err(e))); } Poll::Ready(Some(Ok(bytes))) } Poll::Ready(None) => Poll::Ready(None), Poll::Ready(Some(Err(e))) => Poll::Ready(Some(Err(e))), Poll::Pending => Poll::Pending, } }
} impl http_body::Body for ChecksumBody<SdkBody> { type Data = Bytes; type Error = aws_smithy_http::body::Error; fn poll_data( self: Pin<&mut Self>, cx: &mut Context<'_>, ) -> Poll<Option<Result<Self::Data, Self::Error>>> { self.poll_inner(cx) } fn poll_trailers( self: Pin<&mut Self>, cx: &mut Context<'_>, ) -> Poll<Result<Option<HeaderMap<HeaderValue>>, Self::Error>> { let this = self.project(); match ( this.checksum.headers(), http_body::Body::poll_trailers(this.inner, cx), ) { // If everything is ready, return trailers, merging them if we have more than one map (Ok(outer_trailers), Poll::Ready(Ok(inner_trailers))) => { let trailers = match (outer_trailers, inner_trailers) { // Values from the inner trailer map take precedent over values from the outer map (Some(outer), Some(inner)) => Some(append_merge_header_maps(inner, outer)), // If only one or neither produced trailers, just combine the `Option`s with `or` (outer, inner) => outer.or(inner), }; Poll::Ready(Ok(trailers)) } // If the inner poll is Ok but the outer body's checksum callback encountered an error, // return the error (Err(e), Poll::Ready(Ok(_))) => Poll::Ready(Err(e)), // Otherwise return the result of the inner poll. // It may be pending or it may be ready with an error. (_, inner_poll) => inner_poll, } } fn is_end_stream(&self) -> bool { self.inner.is_end_stream() } fn size_hint(&self) -> SizeHint { let body_size_hint = self.inner.size_hint(); match body_size_hint.exact() { Some(size) => { let checksum_size_hint = self.checksum.size(); SizeHint::with_exact(size + checksum_size_hint) } // TODO is this the right behavior? None => { let checksum_size_hint = self.checksum.size(); let mut summed_size_hint = SizeHint::new(); summed_size_hint.set_lower(body_size_hint.lower() + checksum_size_hint); if let Some(body_size_hint_upper) = body_size_hint.upper() { summed_size_hint.set_upper(body_size_hint_upper + checksum_size_hint); } summed_size_hint } } }
} // The tests I have written are omitted from this RFC for brevity. The request body checksum calculation and trailer size calculations are all tested.

