Users may request checksum validation for response bodies. That capability is provided by ChecksumValidatedBody, which will calculate a checksum as the response body is being read. Once all data has been read, the calculated checksum is compared to a precalculated checksum set during body creation. If the checksums don't match, then the body will emit an error. // In aws-smithy-checksums/src/body.rs
/// A response body that will calculate a checksum as it is read. If all data is read and the
/// calculated checksum doesn't match a precalculated checksum, this body will emit an
/// [asw_smithy_http::body::Error].
#[pin_project]
pub struct ChecksumValidatedBody<InnerBody> { #[pin] inner: InnerBody, #[pin] checksum: Box<dyn Checksum>, precalculated_checksum: Bytes,
} impl ChecksumValidatedBody<SdkBody> { /// Given an `SdkBody`, the name of a checksum algorithm as a `&str`, and a precalculated /// checksum represented as `Bytes`, create a new `ChecksumValidatedBody<SdkBody>`. /// Valid checksum algorithm names are defined in this crate's [root module](super). /// /// # Panics /// /// This will panic if the given checksum algorithm is not supported. pub fn new(body: SdkBody, checksum_algorithm: &str, precalculated_checksum: Bytes) -> Self { Self { checksum: new_checksum(checksum_algorithm), inner: body, precalculated_checksum, } } fn poll_inner( self: Pin<&mut Self>, cx: &mut Context<'_>, ) -> Poll<Option<Result<Bytes, aws_smithy_http::body::Error>>> { let this = self.project(); let inner = this.inner; let mut checksum = this.checksum; match inner.poll_data(cx) { Poll::Ready(Some(Ok(mut data))) => { let len = data.chunk().len(); let bytes = data.copy_to_bytes(len); if let Err(e) = checksum.update(&bytes) { return Poll::Ready(Some(Err(e))); } Poll::Ready(Some(Ok(bytes))) } // Once the inner body has stopped returning data, check the checksum // and return an error if it doesn't match. Poll::Ready(None) => { let actual_checksum = { match checksum.finalize() { Ok(checksum) => checksum, Err(err) => { return Poll::Ready(Some(Err(err))); } } }; if *this.precalculated_checksum == actual_checksum { Poll::Ready(None) } else { // So many parens it's starting to look like LISP Poll::Ready(Some(Err(Box::new(Error::checksum_mismatch( this.precalculated_checksum.clone(), actual_checksum, ))))) } } Poll::Ready(Some(Err(e))) => Poll::Ready(Some(Err(e))), Poll::Pending => Poll::Pending, } }
} /// Errors related to checksum calculation and validation
#[derive(Debug, Eq, PartialEq)]
#[non_exhaustive]
pub enum Error { /// The actual checksum didn't match the expected checksum. The checksummed data has been /// altered since the expected checksum was calculated. ChecksumMismatch { expected: Bytes, actual: Bytes },
} impl Error { /// Given an expected checksum and an actual checksum in `Bytes` form, create a new /// `Error::ChecksumMismatch`. pub fn checksum_mismatch(expected: Bytes, actual: Bytes) -> Self { Self::ChecksumMismatch { expected, actual } }
} impl Display for Error { fn fmt(&self, f: &mut std::fmt::Formatter<'_>) -> Result<(), std::fmt::Error> { match self { Error::ChecksumMismatch { expected, actual } => write!( f, "body checksum mismatch. expected body checksum to be {:x} but it was {:x}", expected, actual ), } }
} impl std::error::Error for Error {} impl http_body::Body for ChecksumValidatedBody<SdkBody> { type Data = Bytes; type Error = aws_smithy_http::body::Error; fn poll_data( self: Pin<&mut Self>, cx: &mut Context<'_>, ) -> Poll<Option<Result<Self::Data, Self::Error>>> { self.poll_inner(cx) } fn poll_trailers( self: Pin<&mut Self>, cx: &mut Context<'_>, ) -> Poll<Result<Option<HeaderMap<HeaderValue>>, Self::Error>> { self.project().inner.poll_trailers(cx) } // Once the inner body returns true for is_end_stream, we still need to // verify the checksum; Therefore, we always return false here. fn is_end_stream(&self) -> bool { false } fn size_hint(&self) -> SizeHint { self.inner.size_hint() }
} // The tests I have written are omitted from this RFC for brevity. The response body checksum verification is tested.

