In order to send a request with checksum trailers, we must use an AWS-specific content encoding called aws-chunked. This encoding requires that we: Divide the original body content into one or more chunks. For our purposes we only ever use one chunk. Append a hexadecimal chunk size header to each chunk. Suffix each chunk with a CRLF (carriage return line feed) . Send a 0 and CRLF to close the original body content section. Send trailers as part of the request body, suffixing each with a CRLF. Send a final CRLF to close the request body. As an example, Sending a regular request body with a SHA-256 checksum would look similar to this: PUT SOMEURL HTTP/1.1
x-amz-checksum-sha256: ZOyIygCyaOW6GjVnihtTFtIS9PNmskdyMlNKiuyjfzw=
Content-Length: 11
... Hello world and the aws-chunked version would look like this: PUT SOMEURL HTTP/1.1
x-amz-trailer: x-amz-checksum-sha256
x-amz-decoded-content-length: 11
Content-Encoding: aws-chunked
Content-Length: 87
... B\r\n
Hello world\r\n
0\r\n
x-amz-checksum-sha256:ZOyIygCyaOW6GjVnihtTFtIS9PNmskdyMlNKiuyjfzw=\r\n
\r\n NOTES: In the second example, B is the hexadecimal representation of 11. Authorization and other headers are omitted from the examples above for brevity. When using aws-chunked content encoding, S3 requires that we send the x-amz-decoded-content-length with the length of the original body content. This encoding scheme is performed by AwsChunkedBody and configured with AwsChunkedBodyOptions. // In aws-http/src/content_encoding.rs
use aws_smithy_checksums::body::ChecksumBody;
use aws_smithy_http::body::SdkBody; use bytes::{Buf, Bytes, BytesMut};
use http::{HeaderMap, HeaderValue};
use http_body::{Body, SizeHint};
use pin_project::pin_project; use std::pin::Pin;
use std::task::{Context, Poll}; const CRLF: &str = "\r\n";
const CHUNK_TERMINATOR: &str = "0\r\n"; /// Content encoding header value constants
pub mod header_value { /// Header value denoting "aws-chunked" encoding pub const AWS_CHUNKED: &str = "aws-chunked";
} /// Options used when constructing an [`AwsChunkedBody`][AwsChunkedBody].
#[derive(Debug, Default)]
#[non_exhaustive]
pub struct AwsChunkedBodyOptions { /// The total size of the stream. For unsigned encoding this implies that /// there will only be a single chunk containing the underlying payload, /// unless ChunkLength is also specified. pub stream_length: Option<u64>, /// The maximum size of each chunk to be sent. /// /// If ChunkLength and stream_length are both specified, the stream will be /// broken up into chunk_length chunks. The encoded length of the aws-chunked /// encoding can still be determined as long as all trailers, if any, have a /// fixed length. pub chunk_length: Option<u64>, /// The length of each trailer sent within an `AwsChunkedBody`. Necessary in /// order to correctly calculate the total size of the body accurately. pub trailer_lens: Vec<u64>,
} impl AwsChunkedBodyOptions { /// Create a new [`AwsChunkedBodyOptions`][AwsChunkedBodyOptions] pub fn new() -> Self { Self::default() } /// Set stream length pub fn with_stream_length(mut self, stream_length: u64) -> Self { self.stream_length = Some(stream_length); self } /// Set chunk length pub fn with_chunk_length(mut self, chunk_length: u64) -> Self { self.chunk_length = Some(chunk_length); self } /// Set a trailer len pub fn with_trailer_len(mut self, trailer_len: u64) -> Self { self.trailer_lens.push(trailer_len); self }
} #[derive(Debug, PartialEq, Eq)]
enum AwsChunkedBodyState { WritingChunkSize, WritingChunk, WritingTrailers, Closed,
} /// A request body compatible with `Content-Encoding: aws-chunked`
///
/// Chunked-Body grammar is defined in [ABNF] as:
///
/// ```txt
/// Chunked-Body = *chunk
/// last-chunk
/// chunked-trailer
/// CRLF
///
/// chunk = chunk-size CRLF chunk-data CRLF
/// chunk-size = 1*HEXDIG
/// last-chunk = 1*("0") CRLF
/// chunked-trailer = *( entity-header CRLF )
/// entity-header = field-name ":" OWS field-value OWS
/// ```
/// For more info on what the abbreviations mean, see https://datatracker.ietf.org/doc/html/rfc7230#section-1.2
///
/// [ABNF]:https://en.wikipedia.org/wiki/Augmented_Backus%E2%80%93Naur_form
#[derive(Debug)]
#[pin_project]
pub struct AwsChunkedBody<InnerBody> { #[pin] inner: InnerBody, #[pin] state: AwsChunkedBodyState, options: AwsChunkedBodyOptions,
} // Currently, we only use this in terms of a streaming request body with checksum trailers
type Inner = ChecksumBody<SdkBody>; impl AwsChunkedBody<Inner> { /// Wrap the given body in an outer body compatible with `Content-Encoding: aws-chunked` pub fn new(body: Inner, options: AwsChunkedBodyOptions) -> Self { Self { inner: body, state: AwsChunkedBodyState::WritingChunkSize, options, } } fn encoded_length(&self) -> Option<u64> { if self.options.chunk_length.is_none() && self.options.stream_length.is_none() { return None; } let mut length = 0; let stream_length = self.options.stream_length.unwrap_or_default(); if stream_length != 0 { if let Some(chunk_length) = self.options.chunk_length { let num_chunks = stream_length / chunk_length; length += num_chunks * get_unsigned_chunk_bytes_length(chunk_length); let remainder = stream_length % chunk_length; if remainder != 0 { length += get_unsigned_chunk_bytes_length(remainder); } } else { length += get_unsigned_chunk_bytes_length(stream_length); } } // End chunk length += CHUNK_TERMINATOR.len() as u64; // Trailers for len in self.options.trailer_lens.iter() { length += len + CRLF.len() as u64; } // Encoding terminator length += CRLF.len() as u64; Some(length) }
} fn prefix_with_chunk_size(data: Bytes, chunk_size: u64) -> Bytes { // Len is the size of the entire chunk as defined in `AwsChunkedBodyOptions` let mut prefixed_data = BytesMut::from(format!("{:X?}\r\n", chunk_size).as_bytes()); prefixed_data.extend_from_slice(&data); prefixed_data.into()
} fn get_unsigned_chunk_bytes_length(payload_length: u64) -> u64 { let hex_repr_len = int_log16(payload_length); hex_repr_len + CRLF.len() as u64 + payload_length + CRLF.len() as u64
} fn trailers_as_aws_chunked_bytes( total_length_of_trailers_in_bytes: u64, trailer_map: Option<HeaderMap>,
) -> Bytes { use std::fmt::Write; // On 32-bit operating systems, we might not be able to convert the u64 to a usize, so we just // use `String::new` in that case. let mut trailers = match usize::try_from(total_length_of_trailers_in_bytes) { Ok(total_length_of_trailers_in_bytes) => { String::with_capacity(total_length_of_trailers_in_bytes) } Err(_) => String::new(), }; let mut already_wrote_first_trailer = false; if let Some(trailer_map) = trailer_map { for (header_name, header_value) in trailer_map.into_iter() { match header_name { // New name, new value Some(header_name) => { if already_wrote_first_trailer { // First trailer shouldn't have a preceding CRLF, but every trailer after it should trailers.write_str(CRLF).unwrap(); } else { already_wrote_first_trailer = true; } trailers.write_str(header_name.as_str()).unwrap(); trailers.write_char(':').unwrap(); } // Same name, new value None => { trailers.write_char(',').unwrap(); } } trailers.write_str(header_value.to_str().unwrap()).unwrap(); } } // Write CRLF to end the body trailers.write_str(CRLF).unwrap(); // If we wrote at least one trailer, we need to write an extra CRLF if total_length_of_trailers_in_bytes != 0 { trailers.write_str(CRLF).unwrap(); } trailers.into()
} impl Body for AwsChunkedBody<Inner> { type Data = Bytes; type Error = aws_smithy_http::body::Error; fn poll_data( self: Pin<&mut Self>, cx: &mut Context<'_>, ) -> Poll<Option<Result<Self::Data, Self::Error>>> { tracing::info!("polling AwsChunkedBody"); let mut this = self.project(); match *this.state { AwsChunkedBodyState::WritingChunkSize => match this.inner.poll_data(cx) { Poll::Ready(Some(Ok(data))) => { // A chunk must be prefixed by chunk size in hexadecimal tracing::info!("writing chunk size and start of chunk"); *this.state = AwsChunkedBodyState::WritingChunk; let total_chunk_size = this .options .chunk_length .or(this.options.stream_length) .unwrap_or_default(); Poll::Ready(Some(Ok(prefix_with_chunk_size(data, total_chunk_size)))) } Poll::Ready(None) => { tracing::info!("chunk was empty, writing last-chunk"); *this.state = AwsChunkedBodyState::WritingTrailers; Poll::Ready(Some(Ok(Bytes::from("0\r\n")))) } Poll::Ready(Some(Err(e))) => Poll::Ready(Some(Err(e))), Poll::Pending => Poll::Pending, }, AwsChunkedBodyState::WritingChunk => match this.inner.poll_data(cx) { Poll::Ready(Some(Ok(mut data))) => { tracing::info!("writing rest of chunk data"); Poll::Ready(Some(Ok(data.copy_to_bytes(data.len())))) } Poll::Ready(None) => { tracing::info!("no more chunk data, writing CRLF and last-chunk"); *this.state = AwsChunkedBodyState::WritingTrailers; Poll::Ready(Some(Ok(Bytes::from("\r\n0\r\n")))) } Poll::Ready(Some(Err(e))) => Poll::Ready(Some(Err(e))), Poll::Pending => Poll::Pending, }, AwsChunkedBodyState::WritingTrailers => { return match this.inner.poll_trailers(cx) { Poll::Ready(Ok(trailers)) => { *this.state = AwsChunkedBodyState::Closed; let total_length_of_trailers_in_bytes = this.options.trailer_lens.iter().fold(0, |acc, n| acc + n); Poll::Ready(Some(Ok(trailers_as_aws_chunked_bytes( total_length_of_trailers_in_bytes, trailers, )))) } Poll::Pending => Poll::Pending, Poll::Ready(Err(e)) => Poll::Ready(Some(Err(e))), }; } AwsChunkedBodyState::Closed => { return Poll::Ready(None); } } } fn poll_trailers( self: Pin<&mut Self>, _cx: &mut Context<'_>, ) -> Poll<Result<Option<HeaderMap<HeaderValue>>, Self::Error>> { // Trailers were already appended to the body because of the content encoding scheme Poll::Ready(Ok(None)) } fn is_end_stream(&self) -> bool { self.state == AwsChunkedBodyState::Closed } fn size_hint(&self) -> SizeHint { SizeHint::with_exact( self.encoded_length() .expect("Requests made with aws-chunked encoding must have known size") as u64, ) }
} // Used for finding how many hexadecimal digits it takes to represent a base 10 integer
fn int_log16<T>(mut i: T) -> u64
where T: std::ops::DivAssign + PartialOrd + From<u8> + Copy,
{ let mut len = 0; let zero = T::from(0); let sixteen = T::from(16); while i > zero { i /= sixteen; len += 1; } len
} #[cfg(test)]
mod tests { use super::AwsChunkedBody; use crate::content_encoding::AwsChunkedBodyOptions; use aws_smithy_checksums::body::ChecksumBody; use aws_smithy_http::body::SdkBody; use bytes::Buf; use bytes_utils::SegmentedBuf; use http_body::Body; use std::io::Read; #[tokio::test] async fn test_aws_chunked_encoded_body() { let input_text = "Hello world"; let sdk_body = SdkBody::from(input_text); let checksum_body = ChecksumBody::new(sdk_body, "sha256"); let aws_chunked_body_options = AwsChunkedBodyOptions { stream_length: Some(input_text.len() as u64), chunk_length: None, trailer_lens: vec![ "x-amz-checksum-sha256:ZOyIygCyaOW6GjVnihtTFtIS9PNmskdyMlNKiuyjfzw=".len() as u64, ], }; let mut aws_chunked_body = AwsChunkedBody::new(checksum_body, aws_chunked_body_options); let mut output = SegmentedBuf::new(); while let Some(buf) = aws_chunked_body.data().await { output.push(buf.unwrap()); } let mut actual_output = String::new(); output .reader() .read_to_string(&mut actual_output) .expect("Doesn't cause IO errors"); let expected_output = "B\r\nHello world\r\n0\r\nx-amz-checksum-sha256:ZOyIygCyaOW6GjVnihtTFtIS9PNmskdyMlNKiuyjfzw=\r\n\r\n"; // Verify data is complete and correctly encoded assert_eq!(expected_output, actual_output); assert!( aws_chunked_body .trailers() .await .expect("checksum generation was without error") .is_none(), "aws-chunked encoded bodies don't have normal HTTP trailers" ); } #[tokio::test] async fn test_empty_aws_chunked_encoded_body() { let sdk_body = SdkBody::from(""); let checksum_body = ChecksumBody::new(sdk_body, "sha256"); let aws_chunked_body_options = AwsChunkedBodyOptions { stream_length: Some(0), chunk_length: None, trailer_lens: vec![ "x-amz-checksum-sha256:47DEQpj8HBSa+/TImW+5JCeuQeRkm5NMpJWZG3hSuFU=".len() as u64, ], }; let mut aws_chunked_body = AwsChunkedBody::new(checksum_body, aws_chunked_body_options); let mut output = SegmentedBuf::new(); while let Some(buf) = aws_chunked_body.data().await { output.push(buf.unwrap()); } let mut actual_output = String::new(); output .reader() .read_to_string(&mut actual_output) .expect("Doesn't cause IO errors"); let expected_output = "0\r\nx-amz-checksum-sha256:47DEQpj8HBSa+/TImW+5JCeuQeRkm5NMpJWZG3hSuFU=\r\n\r\n"; // Verify data is complete and correctly encoded assert_eq!(expected_output, actual_output); assert!( aws_chunked_body .trailers() .await .expect("checksum generation was without error") .is_none(), "aws-chunked encoded bodies don't have normal HTTP trailers" ); }
}

230.body:
When sending checksum-verified requests with a streaming body, we must update the usual signing process. Instead of signing the request based on the request body's checksum, we must sign it with a special header instead: Authorization: <computed authorization header value using "STREAMING-UNSIGNED-PAYLOAD-TRAILER">
x-amz-content-sha256: STREAMING-UNSIGNED-PAYLOAD-TRAILER Setting STREAMING-UNSIGNED-PAYLOAD-TRAILER tells the signer that we're sending an unsigned streaming body that will be followed by trailers. We can achieve this by: Adding a new variant to SignableBody: /// A signable HTTP request body
#[derive(Debug, Clone, Eq, PartialEq)]
#[non_exhaustive]
pub enum SignableBody<'a> { // existing variants have been omitted for brevity... /// An unsigned payload with trailers /// /// StreamingUnsignedPayloadTrailer is used for streaming requests where the contents of the /// body cannot be known prior to signing **AND** which include HTTP trailers. StreamingUnsignedPayloadTrailer,
} Updating the CanonicalRequest::payload_hash method to include the new SignableBody variant: fn payload_hash<'b>(body: &'b SignableBody<'b>) -> Cow<'b, str> { // Payload hash computation // // Based on the input body, set the payload_hash of the canonical request: // Either: // - compute a hash // - use the precomputed hash // - use `UnsignedPayload` // - use `StreamingUnsignedPayloadTrailer` match body { SignableBody::Bytes(data) => Cow::Owned(sha256_hex_string(data)), SignableBody::Precomputed(digest) => Cow::Borrowed(digest.as_str()), SignableBody::UnsignedPayload => Cow::Borrowed(UNSIGNED_PAYLOAD), SignableBody::StreamingUnsignedPayloadTrailer => { Cow::Borrowed(STREAMING_UNSIGNED_PAYLOAD_TRAILER) } }
} (in generated code) Inserting the SignableBody into the request property bag when making a checksum-verified streaming request: if self.checksum_algorithm.is_some() { request .properties_mut() .insert(aws_sig_auth::signer::SignableBody::StreamingUnsignedPayloadTrailer);
} It's possible to send aws-chunked requests where each chunk is signed individually. Because this feature isn't strictly necessary for flexible checksums, I've avoided implementing it.

