Request extensions can be used to adjoin data to a Request as it passes through the middleware. Concretely, they exist as the type map http::Extensions accessed via http::extensions and http::extensions_mut . These can be used to provide data to middleware interested in logging potentially sensitive data. struct Sensitivity { /* Data concerning which parts of the request are sensitive */
} struct Middleware<S> { inner: S
} impl<B, S> Service<Request<B>> for Middleware<S> { /* ... */ fn call(&mut self, request: Request<B>) -> Self::Future { if let Some(sensitivity) = request.extensions().get::<Sensitivity>() { if sensitivity.is_method_sensitive() { debug!(method = %request.method()); } } /* ... */ self.inner.call(request) }
} A middleware layer must be code generated (much in the same way as the logging middleware) which is dedicated to inserting the Sensitivity struct into the extensions of each incoming request. impl<B, S> Service<Request<B>> for SensitivityInserter<S>
where S: Service<Request<B>>
{ /* ... */ fn call(&mut self, request: Request<B>) -> Self::Future { let sensitivity = Sensitivity { /* .. */ }; request.extensions_mut().insert(sensitivity); self.inner.call(request) }
} Advantages Applicable to all middleware which takes http::Request<B>. Does not pollute the API of the middleware - code internal to middleware simply inspects the request's extensions and performs logic based on its value. Disadvantages The sensitivity and HTTP bindings are known at compile time whereas the insertion/retrieval of the extension data is done at runtime. http::Extensions is approximately a HashMap<u64, Box<dyn Any>> so lookup/insertion involves indirection/cache misses/heap allocation.

