In the current version of smithy-rs, customers who want to use errors in event streams need to use them as so: stream! { yield Ok(EventStreamUnion::ErrorVariant ...)
} Furthermore, there is no support for @errors in event streams being terminal; that is, when an error is sent, it does not signal termination and thus does not complete the stream. This RFC proposes to make changes to: terminate the stream upon receiving a modeled error change the API so that customers will write their business logic in a more Rust-like experience: stream! { yield Err(EventStreamUnionError::ErrorKind ...)
} Thus any Err(_) from the stream is terminal, rather than any Ok(x) with x being matched against the set of modeled variant errors in the union.

