}
@error("server")
structure MasterBallUnsuccessful { @required message: String,
}
@error("client")
structure ThrottlingError {} Wherever irrelevant, documentation and other lines are stripped out from the code examples below. Errors in streaming unions The error in AttemptCapturingPokemonEvent is modeled as follows. On the client, pub struct AttemptCapturingPokemonEventError { pub kind: AttemptCapturingPokemonEventErrorKind, pub(crate) meta: aws_smithy_types::Error,
}
pub enum AttemptCapturingPokemonEventErrorKind { MasterBallUnsuccessful(crate::error::MasterBallUnsuccessful), Unhandled(Box<dyn std::error::Error + Send + Sync + 'static>),
} On the server, pub enum AttemptCapturingPokemonEventError { MasterBallUnsuccessful(crate::error::MasterBallUnsuccessful),
} Both are modeled as normal errors, where the name comes from Error with a prefix of the union's name. In fact, both the client and server generate operation errors and event stream errors the same way. Event stream errors have their own marshaller . To make it work for users to stream errors, EventStreamSender<>, in addition to the union type T, takes an error type E; that is, the AttemptCapturingPokemonEventError in the example. This means that an error from the stream is marshalled and sent as a data structure similarly to the union's non-error members. On the other side, the Receiver<> needs to terminate the stream upon receiving any error . A terminated stream has no more data and will always be a bug to use it. An example of how errors can be used on clients, extracted from this test : yield Err(AttemptCapturingPokemonEventError::new( AttemptCapturingPokemonEventErrorKind::MasterBallUnsuccessful(MasterBallUnsuccessful::builder().build()), Default::default()
)); Because unions can be used in input or output of more than one operation, errors must be generated once as they are in the error:: namespace.

