Historically, smithy-rs has borrowed from axum . Despite various divergences the code bases still have much in common: Reliance on Handler trait to abstract over different closure signatures: axum::handler::Handler Handlers A mechanism for turning H: Handler into a tower::Service: axum::handler::IntoService OperationHandler A Router to route requests to various handlers: axum::Router aws_smithy_http_server::routing::Router To identify where the implementations should differ we should classify in what ways the use cases differ. There are two primary areas which we describe below. Extractors and Responses In axum there is a notion of Extractor , which allows the customer to easily define a decomposition of an incoming http::Request by specifying the arguments to the handlers. For example, async fn request(Json(payload): Json<Value>, Query(params): Query<HashMap<String, String>>, headers: HeaderMap) { todo!()
} is a valid handler - each argument satisfies the axum::extract::FromRequest trait, therefore satisfies one of axums blanket Handler implementations: macro_rules! impl_handler { ( $($ty:ident),* $(,)? ) => { impl<F, Fut, Res, $($ty,)*> Handler<($($ty,)*)> for F where F: FnOnce($($ty,)*) -> Fut + Clone + Send + 'static, Fut: Future<Output = Res> + Send, Res: IntoResponse, $( $ty: FromRequest + Send,)* { fn call(self, req: http::Request) -> Self::Future { async { let mut req = RequestParts::new(req); $( let $ty = match $ty::from_request(&mut req).await { Ok(value) => value, Err(rejection) => return rejection.into_response(), }; )* let res = self($($ty,)*).await; res.into_response() } } } };
} The implementations of Handler in axum and smithy-rs follow a similar pattern - convert http::Request into the closure's input, run the closure, convert the output of the closure to http::Response. In smithy-rs we do not need a general notion of "extractor" - the http::Request decomposition is specified by the Smithy model, whereas in axum it's defined by the handlers signature. Despite the Smithy specification the customer may still want an "escape hatch" to allow them access to data outside of the Smithy service inputs, for this reason we should continue to support a restricted notion of extractor. This will help support use cases such as passing lambda_http::Context through to the handler despite it not being modeled in the Smithy model. Dual to FromRequest is the axum::response::IntoResponse trait. This plays the role of converting the output of the handler to http::Response. Again, the difference between axum and smithy-rs is that smithy-rs has the conversion from {Operation}Output to http::Response specified by the Smithy model, whereas in axum the customer is free to specify a return type which implements axum::response::IntoResponse. Routing The Smithy model not only specifies the http::Request decomposition and http::Response composition for a given service, it also determines the routing. The From<OperationRegistry> implementation, described in Builder , yields a fully formed router based on the protocol and http traits specified. This is in contrast to axum, where the user specifies the routing by use of various combinators included on the axum::Router, applied to other tower::Services. In an axum application one might encounter the following code: let user_routes = Router::new().route("/:id", /* service */); let team_routes = Router::new().route("/", /* service */); let api_routes = Router::new() .nest("/users", user_routes) .nest("/teams", team_routes); let app = Router::new().nest("/api", api_routes); Note that, in axum handlers are eagerly converted to a tower::Service (via IntoService) before they are passed into the Router. In contrast, in smithy-rs, handlers are passed into a builder and then the conversion to tower::Service is performed (via OperationHandler). Introducing state to handlers in axum is done in the same way as smithy-rs, described briefly in Handlers - a layer is used to insert state into incoming http::Requests and the Handler implementation pops it out of the type map layer. In axum, if a customer wanted to scope state to all routes within /users/ they are able to do the following: async fn handler(Extension(state): Extension</* State */>) -> /* Return Type */ {} let api_routes = Router::new() .nest("/users", user_routes.layer(Extension(/* state */))) .nest("/teams", team_routes); In smithy-rs a customer is only able to apply a layer around the aws_smithy_http::routing::Router or around every route via the layer method described above.

