To start, let's examine InvalidFullUriError (doc comments omitted): #[derive(Debug)]
#[non_exhaustive]
pub enum InvalidFullUriError { #[non_exhaustive] InvalidUri(InvalidUri), #[non_exhaustive] NoDnsService, #[non_exhaustive] MissingHost, #[non_exhaustive] NotLoopback, DnsLookupFailed(io::Error),
} impl Display for InvalidFullUriError { fn fmt(&self, f: &mut Formatter<'_>) -> std::fmt::Result { match self { InvalidFullUriError::InvalidUri(err) => write!(f, "URI was invalid: {}", err), InvalidFullUriError::MissingHost => write!(f, "URI did not specify a host"), // ... omitted ... } }
} impl Error for InvalidFullUriError { fn source(&self) -> Option<&(dyn Error + 'static)> { match self { InvalidFullUriError::InvalidUri(err) => Some(err), InvalidFullUriError::DnsLookupFailed(err) => Some(err), _ => None, } }
} This error does a few things well: Using #[non_exhaustive] on the enum allows new errors to be added in the future. Breaking out different error types allows for more useful error messages, potentially with error-specific context. Customers can match on these different error variants to change their program flow, although it's not immediately obvious if such use cases exist for this error. The error cause is available through the Error::source() impl for variants that have a cause. However, there are also a number of things that could be improved: All tuple/struct enum members are public, and InvalidUri is an error from the http crate. Exposing a type from another crate can potentially lock the GA SDK into a specific crate version if breaking changes are ever made to the exposed types. In this specific case, it prevents using alternate HTTP implementations that don't use the http crate. DnsLookupFailed is missing #[non_exhaustive], so new members can never be added to it. Use of enum tuples, even with #[non_exhaustive], adds friction to evolving the API since the tuple members cannot be named. Printing the source error in the Display impl leads to error repetition by reporters that examine the full source chain. The source() impl has a _ match arm, which means future implementers could forget to propagate a source when adding new error variants. The error source can be downcasted to InvalidUri type from http in customer code. This is a leaky abstraction where customers can start to rely on the underlying library the SDK uses in its implementation, and if that library is replaced/changed, it can silently break the customer's application. Note: later in the RFC, I'll demonstrate why fixing this issue is not practical.

