Actionable errors are represented as enums. If an error variant has an error source or additional contextual information, it must use a separate context struct that is referenced via tuple in the enum. For example: // Good: new error types can be added in the future
#[non_exhaustive]
pub enum Error { // Good: This is exhaustive and uses a tuple, but its sole member is an extensible struct with private fields VariantA(VariantA), // Bad: The fields are directly exposed and can't have accessor methods. The error // source type also can't be changed at a later date since. #[non_exhaustive] VariantB { some_additional_info: u32, source: AnotherError // AnotherError is from this crate }, // Bad: There's no way to add additional contextual information to this error in the future, even // though it is non-exhaustive. Changing it to a tuple or struct later leads to compile errors in existing // match statements. #[non_exhaustive] VariantC, // Bad: Not extensible if additional context is added later (unless that context can be added to `AnotherError`) #[non_exhaustive] VariantD(AnotherError), // Bad: Not extensible. If new context is added later (for example, a second endpoint), there's no way to name it. #[non_exhaustive] VariantE(Endpoint, AnotherError), // Bad: Exposes another library's error type in the public API, // which makes upgrading or replacing that library a breaking change #[non_exhaustive] VariantF { source: http::uri::InvalidUri }, // Bad: The error source type is public, and even though its a boxed error, it won't // be possible to change it to an opaque error type later (for example, if/when // opaque errors become practical due to standard library stabilizations). #[non_exhaustive] VariantG { source: Box<dyn Error + Send + Sync + 'static>, }
