} impl VariantA { fn some_field(&self) -> u32 { self.some_field }
} Error variants that contain a source must return it from the Error::source method. The source implementation should not use the catch all (_) match arm, as this makes it easy to miss adding a new error variant's source at a later date. The error Display implementation must not include the source in its output: // Good
