} // Bad
impl fmt::Display for Error { fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result { match self { Self::VariantA => write!(f, "variant a"), // Bad: includes the source in the `Display` output, which leads to duplicate error information Self::VariantB { some_additional_info, source } => write!(f, "variant b ({some_additional_info}): {source}"), // ... and so on } }
