Let's take a second look at the (updated) definition of PokemonServiceBuilder: pub struct PokemonServiceBuilder< Op1, Op2, Op3, Op4, Op5, Op6, Exts1 = (), Exts2 = (), Exts3 = (), Exts4 = (), Exts5 = (), Exts6 = (), Pl = aws_smithy_http_server::plugin::IdentityPlugin,
> { check_health: Option<Op1>, do_nothing: Option<Op2>, get_pokemon_species: Option<Op3>, get_server_statistics: Option<Op4>, capture_pokemon: Option<Op5>, get_storage: Option<Op6>, #[allow(unused_parens)] _exts: std::marker::PhantomData<(Exts1, Exts2, Exts3, Exts4, Exts5, Exts6)>, plugin: Pl,
} We have 13 generic parameters: 1 for plugins (Pl); 2 for each operation (OpX and ExtsX); All those generic parameters were necessary when we were using the typestate builder pattern . They kept track of which operation handlers were missing: if any OpX was set to MissingOperation when calling build -> compilation error! Do we still need all those generic parameters if we move forward with this RFC? You might be asking yourselves: why do those generics bother us? Is there any harm in keeping them around? We'll look at the impact of those generic parameters on two scenarios: Branching in startup logic; Breaking down a monolithic startup function into multiple smaller functions.

