} else { app.check_health(check_health_with_database)
};
app.build(); The compiler is not pleased: error[E0308]: `if` and `else` have incompatible types --> pokemon-service/src/bin/pokemon-service.rs:39:9 |
36 | let app = if check_database { | _______________-
37 | | app.check_health(check_health) | | ------------------------------ expected because of this
38 | | } else {
39 | | app.check_health(check_health_with_database) | | ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^ expected fn item, found a different fn item
40 | | }; | |_____- `if` and `else` have incompatible types | = note: expected struct `PokemonServiceBuilder<Operation<IntoService<_, fn(CheckHealthInput) -> impl Future<Output = CheckHealthOutput> {check_health}>>, _, _, _, _, _, _, _, _, _, _, _>` found struct `PokemonServiceBuilder<Operation<IntoService<_, fn(CheckHealthInput) -> impl Future<Output = CheckHealthOutput> {check_health_with_database}>>, _, _, _, _, _, _, _, _, _, _, _>` The developer must be aware of the following facts to unpack the error message: The two branches of an if/else statement need to return the same type. Each function closure has a new unique type (represented as fn(CheckHealthInput) -> impl Future<Output = CheckHealthOutput> {check_health} for check_health); The handler function type becomes part of the overall PokemonServiceBuilder type, a cog in the larger Op1 generic parameter used to hold the handler for the CheckHealth operation (i.e. Operation<IntoService<_, fn(CheckHealthInput) -> impl Future<Output = CheckHealthOutput> {check_health}>>); The second fact requires an intermediate understanding of Rust's closures and opaque types (impl Trait). It's quite likely to confuse Rust beginners. The developer has three options to move forward: Convert check_health and check_health_with_database into a common type that can be passed as a handler to PokemonServiceBuilder::check_health; Invoke the build method inside the two branches in order to return a "plain" PokemonService<Route<B>> from both branches. Embed the configuration parameter (check_database) in the application state, retrieve it inside check_health and perform the branching there. I can't easily see a way to accomplish 1) using the current API. Pursuing 2) is straight-forward with a single conditional: let check_database: bool = /* */;
