} A lot of repetition compared to the code for the "obvious" approach: let check_database: bool = /* */;
let include_cpu_statics: bool = /* */;
let app = if check_database { app.check_health(check_health)
} else { app.check_health(check_health_with_database)
};
let app = if include_cpu_statistics { app.get_server_statistics(get_server_statistics_with_cpu)
} else { app.get_server_statistics(get_server_statistics)
};
app.build(); The obvious approach becomes viable if we stop embedding the handler function type in PokemonServiceBuilder's overall type.

