311.body:
The previous two examples should have convinced you that the 2N+1 generic parameters on PokemonServiceBuilder harm the ergonomics of our API. Can we get rid of them? Yes! Let's look at one possible approach: pub struct PokemonServiceBuilder<Body, Plugin> { check_health: Option<Route<Body>>, do_nothing: Option<Route<Body>>, get_pokemon_species: Option<Route<Body>>, get_server_statistics: Option<Route<Body>>, capture_pokemon: Option<Route<Body>>, get_storage: Option<Route<Body>>, plugin: Plugin,
} We no longer store the raw handlers inside PokemonServiceBuilder. We eagerly upgrade the operation handlers to a Route instance when they are registered with the builder. impl<Body, Plugin> PokemonServiceBuilder<Body, Plugin> { pub fn get_pokemon_species<Handler, Extensions>(mut self, handler: Handler) -> Self /* Complex trait bounds */ { let route = Route::new(Operation::from_handler(handler).upgrade(&self.plugin)); self.get_pokemon_species = Some(route); self } /* other setters and methods */
} The existing API performs the upgrade when build is called, forcing PokemonServiceBuilder to store the raw handlers and keep two generic parameters around (OpX and ExtsX) for each operation. The proposed API requires plugins to be specified upfront, when creating an instance of the builder. They cannot be modified after a PokemonServiceBuilder instance has been built: impl PokemonService<()> { /// Constructs a builder for [`PokemonService`]. pub fn builder<Body, Plugin>(plugin: Plugin) -> PokemonServiceBuilder<Body, Plugin> { PokemonServiceBuilder { check_health: None, do_nothing: None, get_pokemon_species: None, get_server_statistics: None, capture_pokemon: None, get_storage: None, plugin, } }
} This constraint guarantees that all operation handlers are upgraded to a Route using the same set of plugins. Having to specify all plugins upfront is unlikely to have a negative impact on developers currently using smithy-rs. We have seen how cumbersome it is to break the startup logic into different functions using the current service builder API. Developers are most likely specifying all plugins and routes in the same function even if the current API allows them to intersperse route registrations and plugin registrations: they would simply have to re-order their registration statements to adopt the API proposed in this RFC.

312.body:
The new design prohibits the following invocation style: let plugin = ColorPlugin::new();
PokemonService::builder(plugin) // [...] .get_pokemon_species(get_pokemon_species) // Add PrintPlugin .print() .get_storage(get_storage) .build() We could choose to remove this limitation and allow handlers to be upgraded using a different set of plugins depending on where they were registered. In the snippet above, for example, we would have: get_pokemon_species is upgraded using just the ColorPlugin; get_storage is upgraded using both the ColorPlugin and the PrintPlugin. There are no technical obstacles preventing us from implementing this API, but I believe it could easily lead to confusion and runtime surprises due to a mismatch between what the developer might expect PrintPlugin to apply to (all handlers) and what it actually applies to (handlers registered after .print()). We can provide developers with other mechanisms to register plugins for a single operation or a subset of operations without introducing ambiguity. For attaching additional plugins to a single operation, we could introduce a blanket Pluggable implementation for all operations in aws-smithy-http-server: impl<P, Op, Pl, S, L> Pluggable<Pl> for Operation<S, L> where Pl: Plugin<P, Op, S, L> { type Output = Operation<Pl::Service, Pl::Layer>; fn apply(self, new_plugin: Pl) -> Self::Output { new_plugin.map(self) }
} which would allow developers to invoke op.apply(MyPlugin) or call extensions methods such as op.print() where op is an Operation. For attaching additional plugins to a subgroup of operations, instead, we could introduce nested builders: let initial_plugins = ColorPlugin;
let mut builder = PokemonService::builder(initial_plugins) .get_pokemon_species(get_pokemon_species);
let additional_plugins = PrintPlugin;
// PrintPlugin will be applied to all handlers registered on the scoped builder returned by `scope`.
let nested_builder = builder.scoped(additional_plugins) .get_storage(get_storage) .capture_pokemon(capture_pokemon) // Register all the routes on the scoped builder with the parent builder. // API names are definitely provisional and bikesheddable. .attach(builder);
let app = builder.build(); Both proposals are outside the scope of this RFC, but they are shown here for illustrative purposes.

313.body:
A lot of our issues stem from type mismatch errors: we are encoding the type of our handlers into the overall type of the service builder and, as a consequence, we end up modifying that type every time we set a handler or modify its state. Type erasure is a common approach for mitigating these issues - reduce those generic parameters to a common type to avoid the mismatch errors. This whole RFC can be seen as a type erasure proposal - done eagerly, as soon as the handler is registered, using Option<Route<B>> as our "common type" after erasure. We could try to strike a different balance - i.e. avoid performing type erasure eagerly, but allow developers to erase types on demand. Based on my analysis, this could happen in two ways: We cast handlers into a Box<dyn Upgradable<Protocol, Operation, Exts, Body, Plugin>> to which we can later apply plugins (lazy type erasure); We upgrade registered handlers to Route<B> and apply plugins in the process (eager type erasure on-demand). Let's ignore these implementation issues for the time being to focus on what the ergonomics would look like assuming we can actually perform type erasure. In practice, we are going to assume that: In approach 1), we can call .boxed() on a registered operation and get a Box<dyn Upgradable> back; In approach 2), we can call .erase() on the entire service builder and convert all registered operations to Route<B> while keeping the MissingOperation entries as they are. After erase has been called, you can no longer register plugins (or, alternatively, the plugins you register will only apply new handlers). We are going to explore both approaches under the assumption that we want to preserve compile-time verification for missing handlers. If we are willing to abandon compile-time verification, we get better ergonomics since all OpX and ExtsX generic parameters can be erased (i.e. we no longer need to worry about MissingOperation). On Box<dyn Upgradable<Protocol, Operation, Exts, Body, Plugin>> This is the current definition of the Upgradable trait: /// Provides an interface to convert a representation of an operation to a HTTP [`Service`](tower::Service) with
/// canonical associated types.
pub trait Upgradable<Protocol, Operation, Exts, Body, Plugin> { type Service: Service<http::Request<Body>, Response = http::Response<BoxBody>>; /// Performs an upgrade from a representation of an operation to a HTTP [`Service`](tower::Service). fn upgrade(self, plugin: &Plugin) -> Self::Service;
} In order to perform type erasure, we need to determine: what type parameters we are going to pass as generic arguments to Upgradable; what type we are going to use for the associated type Service. We have: there is a single known protocol for a service, therefore we can set Protocol to its concrete type (e.g. AwsRestJson1); each handler refers to a different operation, therefore we cannot erase the Operation and the Exts parameters; both Body and Plugin appear as generic parameters on the service builder itself, therefore we can set them to the same type; we can use Route<B> to normalize the Service associated type. The above leaves us with two unconstrained type parameters, Operation and Exts, for each operation. Those unconstrained type parameters leak into the type signature of the service builder itself. We therefore find ourselves having, again, 2N+2 type parameters. Branching Going back to the branching example: let check_database: bool = /* */;
let builder = if check_database { builder.check_health(check_health)
} else { builder.check_health(check_health_with_database)
};
let app = builder.build(); In approach 1), we could leverage the .boxed() method to convert the actual OpX type into a Box<dyn Upgradable>, thus ensuring that both branches return the same type: let check_database: bool = /* */;
let builder = if check_database { builder.check_health_operation(Operation::from_handler(check_health).boxed())
} else { builder.check_health_operation(Operation::from_handler(check_health_with_database).boxed())
};
let app = builder.build(); The same cannot be done when conditionally registering a route, because on the else branch we cannot convert MissingOperation into a Box<dyn Upgradable> since MissingOperation doesn't implement Upgradable - the pillar on which we built all our compile-time safety story. // This won't compile!
let builder = if check_database { builder.check_health_operation(Operation::from_handler(check_health).boxed())
} else { builder
}; In approach 2), we can erase the whole builder in both branches when they both register a route: let check_database: bool = /* */;
let boxed_builder = if check_database { builder.check_health(check_health).erase()
} else { builder.check_health(check_health_with_database).erase()
};
let app = boxed_builder.build(); but, like in approach 1), we will still get a type mismatch error if one of the two branches leaves the route unset. Refactoring into smaller functions Developers would still have to spell out all generic parameters when writing a function that takes in a builder as a parameter: fn partial_setup<Op1, Op2, Op3, Op4, Op5, Op6, Body, Plugin>( builder: PokemonServiceBuilder<Op1, Op2, Op3, Op4, Op5, Op6, Body, Plugin>,
) -> PokemonServiceBuilder<Op1, Op2, Op3, Op4, Op5, Op6, Body, Plugin> { builder
} Writing the signature after having modified the builder becomes easier though. In approach 1), they can explicitly change the touched operation parameters to the boxed variant: fn partial_setup<Op1, Op2, Op3, Op4, Op5, Op6, Exts4, Body, Plugin>( builder: PokemonServiceBuilder<Op1, Op2, Op3, Op4, Op5, Op6, Body, Plugin, Exts4=Exts4>,
) -> PokemonServiceBuilder< Op1, Op2, Op3, Box<dyn Upgradable<AwsRestJson1, GetServerStatistics, Exts4, Body, Plugin>>, Op5, Op6, Body, Plugin, Body, Plugin, Exts4=Exts > { builder.get_server_statistics(get_server_statistics)
} It becomes trickier in approach 2), since to retain compile-time safety on the builder we expect erase to map MissingOperation into MissingOperation. Therefore, we can't write something like this: fn partial_setup<Body, Op1, Op2, Op3, Op4, Op5, Op6>( builder: PokemonServiceBuilder<Op1, Op2, Op3, Op4, Op5, Op6>,
) -> PokemonServiceBuilder<Route<B>, Route<B>, Route<B>, Route<B>, Route<B>, Route<B>> { builder.get_server_statistics(get_server_statistics).()
} The compiler would reject it since it can't guarantee that all other operations can be erased to a Route<B>. This is likely to require something along the lines of: fn partial_setup<Body, Op1, Op2, Op3, Op4, Op5, Op6>( builder: PokemonServiceBuilder<Op1, Op2, Op3, Op4, Op5, Op6>,
) -> PokemonServiceBuilder<<Op1 as TypeErase>::Erased, <Op2 as TypeErase>::Erased, <Op3 as TypeErase>::Erased, <Op4 as TypeErase>::Erased, <Op5 as TypeErase>::Erased, <Op6 as TypeErase>::Erased>
where // Omitting a bunch of likely needed additional generic parameters and bounds here Op1: TypeErase, Op2: TypeErase, Op3: TypeErase, Op4: TypeErase, Op5: TypeErase, Op6: TypeErase,
{ builder.get_server_statistics(get_server_statistics).()
} Summary Both approaches force us to have a number of generic parameters that scales linearly with the number of operations on the service, affecting the ergonomics of the resulting API in both the branching and the refactoring scenarios. We believe that the ergonomics advantages of the proposal advanced by this RFC outweigh the limitation of having to specify your plugins upfront, when creating the builder instance.

