The Pluggable trait was an interesting development out of RFC 20 : it allows you to attach methods to a service builder using an extension trait. /// An extension to service builders to add the `print()` function.
pub trait PrintExt: aws_smithy_http_server::plugin::Pluggable<PrintPlugin> { /// Causes all operations to print the operation name when called. /// /// This works by applying the [`PrintPlugin`]. fn print(self) -> Self::Output where Self: Sized, { self.apply(PrintPlugin) }
} This pattern needs to be revisited if we want to move forward with this RFC, since new plugins cannot be registered after the builder has been instantiated. My recommendation would be to implement Pluggable for PluginStack, providing the same pattern ahead of the creation of the builder: // Currently you'd have to go for `PluginStack::new(IdentityPlugin, IdentityPlugin)`,
// but that can be smoothed out even if this RFC isn't approved.
let plugin_stack = PluginStack::default() // Use the extension method .print();
let app = PokemonService::builder(plugin_stack) .get_pokemon_species(get_pokemon_species) .get_storage(get_storage) .get_server_statistics(get_server_statistics) .capture_pokemon(capture_pokemon) .do_nothing(do_nothing) .build()?;

319.body:
The proposal is to implement a RequestId type and make it available to middleware and business logic handlers, through FromParts and as a Service. To aid customers already relying on clients' request IDs, there will be two types: ClientRequestId and ServerRequestId. Implementing FromParts for Extension<RequestId> gives customers the ability to write their handlers: pub async fn handler( input: input::Input, request_id: Extension<ServerRequestId>,
) -> ... pub async fn handler( input: input::Input, request_id: Extension<ClientRequestId>,
) -> ... ServerRequestId and ClientRequestId will be injected into the extensions by a layer. This layer can also be used to open a span that will log the request ID: subsequent logs will be in the scope of that span. ServerRequestId format: Common formats for RequestIDs are: UUID: a random string, represented in hex, of 128 bits from IETF RFC 4122: 7c038a43-e499-4162-8e70-2d4d38595930 The hash of a sequence such as date+thread+server: 734678902ea938783a7200d7b2c0b487 A verbose description: current_ms+hostname+increasing_id For privacy reasons, any format that provides service details should be avoided. A random string is preferred. The proposed format is to use UUID, version 4. A Service that inserts a RequestId in the extensions will be implemented as follows: impl<R, S> Service<http::Request<R>> for ServerRequestIdProvider<S>
where S: Service<http::Request<R>>,
{ type Response = S::Response; type Error = S::Error; type Future = S::Future; fn poll_ready(&mut self, cx: &mut Context<'_>) -> Poll<Result<(), Self::Error>> { self.inner.poll_ready(cx) } fn call(&mut self, mut req: http::Request<R>) -> Self::Future { req.extensions_mut().insert(ServerRequestId::new()); self.inner.call(req) }
} For client request IDs, the process will be, in order: If a header is found matching one of the possible ones, use it Otherwise, None Option is used to distinguish whether a client had provided an ID or not. impl<R, S> Service<http::Request<R>> for ClientRequestIdProvider<S>
where S: Service<http::Request<R>>,
{ type Response = S::Response; type Error = S::Error; type Future = S::Future; fn poll_ready(&mut self, cx: &mut Context<'_>) -> Poll<Result<(), Self::Error>> { self.inner.poll_ready(cx) } fn call(&mut self, mut req: http::Request<R>) -> Self::Future { for possible_header in self.possible_headers { if let Some(id) = req.headers.get(possible_header) { req.extensions_mut().insert(Some(ClientRequestId::new(id))); return self.inner.call(req) } } req.extensions_mut().insert(None); self.inner.call(req) }
} The string representation of a generated ID will be valid for this regex: For ServerRequestId: /^[A-Za-z0-9_-]{,48}$/ For ClientRequestId: see the spec Although the generated ID is opaque, this will give guarantees to customers as to what they can expect, if the server ID is ever updated to a different format.

324.body:
Consider the following Smithy model: @length(min: 1, max: 69)
string NiceString The central idea to the implementation of constraint traits is: parse, don't validate . Instead of code-generating a Rust String to represent NiceString values and perform the validation at request deserialization, we can leverage Rust's type system to guarantee domain invariants . We can generate a wrapper tuple struct that parses the string's value and is "tight" in the set of values it can accept: pub struct NiceString(String); impl TryFrom<String> for NiceString { type Error = nice_string::ConstraintViolation; fn try_from(value: String) -> Result<Self, Self::Error> { let num_code_points = value.chars().count(); if 1 <= num_code_points && num_code_points <= 69 { Ok(Self(value)) } else { Err(nice_string::ConstraintViolation::Length(num_code_points)) } }
} (Note that we're using the linear time check chars().count() instead of len() on the input value, since the Smithy specification says the length trait counts the number of Unicode code points when applied to string shapes .) The goal is to enforce, at the type-system level, that these constrained structs always hold valid data. It should be impossible for the service implementer, without resorting to unsafe Rust, to construct a NiceString that violates the model. The actual check is performed in the implementation of TryFrom <InnerType> for the generated struct, which makes it convenient to use the ? operator for error propagation . Each constrained struct will have a related std::error::Error enum type to signal the first parsing failure, with one enum variant per applied constraint trait: pub mod nice_string { pub enum ConstraintViolation { /// Validation error holding the number of Unicode code points found, when a value between `1` and /// `69` (inclusive) was expected. Length(usize), } impl std::error::Error for ConstraintViolation {}
} std::error::Error requires Display and Debug . We will #[derive(Debug)], unless the shape also has the sensitive trait , in which case we will just print the name of the struct: impl std::fmt::Debug for ConstraintViolation { fn fmt(&self, f: &mut std::fmt::Formatter<'_>) -> std::fmt::Result { let mut formatter = f.debug_struct("ConstraintViolation"); formatter.finish() }
} Display is used to produce human-friendlier representations. Its implementation might be called when formatting a 400 HTTP response message in certain protocols, for example.

