We will continue to deserialize the different parts of the HTTP message into the regular Rust standard library types. However, just before the deserialization function returns, we will convert the type into the wrapper tuple struct that will eventually be handed over to the operation handler. This is what we're already doing when deserializing strings into enums. For example, given the Smithy model: @enum([ { name: "Spanish", value: "es" }, { name: "English", value: "en" }, { name: "Japanese", value: "jp" },
