string PatternString Our implementation currently enforces constraints from the leaf to the root : when enforcing the @length constraint, the TryFrom constructor the server framework uses gets a Vec<String> and first checks the members adhere to the @pattern trait, and only after is the @length trait checked. This means that if a client sends a request with n >>> 3 list members, the expensive check runs n times, when a constant-time check inspecting the length of the input vector would have sufficed to reject the request. Additionally, we may want to avoid serializing n ValidationExceptionFields due to performance concerns. A possibility to circumvent this is making the @length validator special, having it bound the other validators via effectively permuting the order of the checks and thus short-circuiting. In general, it's unclear what constraint traits should cause short-circuiting. A probably reasonable rule of thumb is to include traits that can be attached directly to aggregate shapes: as of writing, that would be @uniqueItems on list shapes and @length on list shapes. Another possiblity is to do nothing and value complete validation exception response messages over trying to mitigate this with special handling. One could argue that these kind of DOS attack vectors should be taken care of with a separate solution e.g. a layer that bounds a request body's size to a reasonable default (see how Axum added this ). We will provide a similar request body limiting mechanism regardless. This RFC advocates for implementing the first option, arguing that it's fair to say that the framework should return an error that is as informative as possible, but it doesn't necessarily have to be complete . However, we will also write a layer, applied by default to all server SDKs, that bounds a request body's size to a reasonable (yet high) default. Relying on users to manually apply the layer is dangerous, since such a configuration is trivially exploitable . Users can always man