} And this time let's feature both the resulting ConstraintViolationExceptions and ConstraintViolations types: pub mod a { pub struct ConstraintViolationExceptions { // All fields must be `Option`, despite the members being `@required`, // since no violations for their values might have occurred. pub missing_member_exception: Option<constraint_violation_exception::MissingMember>, pub missing_length_map_exception: Option<constraint_violation_exception::MissingLengthMap>, pub length_map_exceptions: Option<crate::model::length_map::ConstraintViolationExceptions>, } pub mod constraint_violation_exception { pub struct MissingMember; pub struct MissingLengthMap; } pub struct ConstraintViolations { pub missing_member: Option<constraint_violation::MissingMember>, pub missing_length_map: Option<constraint_violation::MissingLengthMap>, } pub mod constraint_violation { pub struct MissingMember; pub struct MissingLengthMap; }
} As can be intuited, the only differences are that: ConstraintViolationExceptions hold transitive violations while ConstraintViolations only need to expose direct violations (as explained in the Impossible constraint violations section), ConstraintViolationExceptions have members suffixed with _exception, as is the module name. Note that while the constraint violation (exception) type names are plural, the module names are always singular. We also make a conscious decision of, in this case of structure shapes, making the types of all members Options, for simplicity. Another choice would have been to make length_map_exceptions not Option-al, and, in the case where no violations in LengthMap values occurred, set length_map::ConstraintViolations::length to None and length_map::ConstraintViolations::member_violations eventually reach an empty iterator. However, it's best that we use the expressiveness of Options at the earliest ("highest" in the shape hierarchy) opportunity: if a member is Some, it means it (eventually) reaches data.

