Type map : A data structure where stored values are keyed by their type. Hence, only one value can be stored for a given type. See typemap , type-map , http::Extensions , and actix_http::Extensions for examples. let conf: ConfigBag = aws_config::from_env() // Configuration can be common to all smithy clients .with(RetryConfig::builder().disable_retries().build()) // Or, protocol-specific .with(HttpClient::builder().build()) // Or, AWS-specific .with(Region::from("us-east-1")) // Or, service-specific .with(S3Config::builder().force_path_style(false).build()) .await; let client = aws_sdk_s3::Client::new(&conf); client.list_buckets() .customize() // Configuration can be set on operations as well as clients .with(HttpConfig::builder().conn(some_other_conn).build()) .send() .await; Setting configuration that will not be used wastes memory and can make debugging more difficult. Therefore, configuration defaults are only set when they're relevant. For example, if a smithy service doesn't support HTTP, then no HTTP client will be set. What is "layered" configuration? Configuration has precedence. Configuration set on an operation will override configuration set on a client, and configuration set on a client will override default configuration. However, configuration with a higher precedence can also augment configuration with a lower precedence. For example: let conf: ConfigBag = aws_config::from_env() .with( SomeConfig::builder() .option_a(1) .option_b(2) .option_c(3) ) .build() .await; let client = aws_sdk_s3::Client::new(&conf); client.list_buckets() .customize() .with( SomeConfig::builder() .option_a(0) .option_b(Value::Inherit) .option_c(Value::Unset) ) .build() .send() .await; In the above example, when the option_a, option_b, option_c, values of SomeConfig are accessed, they'll return: option_a: 0 option_b: 2 option_c: No value Config values are wrapped in a special enum called Value with three variants: Value::Set: A set value that will override values from lower layers. Value::Unset: An explicitly unset value that will override values from lower layers. Value::Inherit: An explicitly unset value that will inherit a value from a lower layer. Builders are defined like this: struct SomeBuilder { value: Value<T>,
} impl struct SomeBuilder<T> { fn new() -> Self { // By default, config values inherit from lower-layer configs Self { value: Value::Inherit } } fn some_field(&mut self, value: impl Into<Value<T>>) -> &mut self { self.value = value.into(); self }
} Because of impl Into<Value<T>>, users don't need to reference the Value enum unless they want to "unset" a value. Layer separation and precedence Codegen defines default sets of interceptors and runtime plugins at various "levels": AWS-wide defaults set by codegen. Service-wide defaults set by codegen. Operation-specific defaults set by codegen. Likewise, users may mount their own interceptors and runtime plugins: The AWS config level, e.g. aws_types::Config. The service config level, e.g. aws_sdk_s3::Config. The operation config level, e.g. aws_sdk_s3::Client::get_object. Configuration is resolved in a fixed manner by reading the "lowest level" of config available, falling back to "higher levels" only when no value has been set. Therefore, at least 3 separate ConfigBags are necessary, and user configuration has precedence over codegen-defined default configuration. With that in mind, resolution of configuration would look like this: Check user-set operation config. Check codegen-defined operation config. Check user-set service config. Check codegen-defined service config. Check user-set AWS config. Check codegen-defined AWS config.

