Structures are marked #[non_exhaustive] Structures must be instantiated using builders Structures must not derive Default in the event that required fields are added in the future. In general, adding a new public member to a structure in Rust is not backwards compatible. However, by applying the #[non_exhaustive] to the structures generated by the Rust SDK, the Rust compiler will prevent users from using our structs in ways that prevent new fields from being added in the future. Note : in this context, the optionality of the fields is irrelevant. Specifically, #[non_exhaustive] prohibits the following patterns: Direct structure instantiation: # fn foo() {
let ip_addr = IpAddress { addr: "192.168.1.1" };
# } If a new member is_local: boolean was added to the IpAddress structure, this code would not compile. To enable users to still construct our structures while maintaining backwards compatibility, all structures expose a builder, accessible at SomeStruct::Builder: # fn foo() {
let ip_addr = IpAddress::builder().addr("192.168.1.1").build();
# } Structure destructuring: # fn foo() {
let IpAddress { addr } = some_ip_addr();
# } This will also fail to compile if a new member is added, however, by adding #[non_exhaustive], the .. multifield wildcard MUST be added to support new fields being added in the future: # fn foo() {
