A Retry Strategy is the process by which the orchestrator determines when and how to retry failed requests. Only one retry strategy may be set at any given time. During its operation, the retry strategy relies on a series of Retry Classifiers to determine if and how a failed request should be retried. Retry classifiers each have a Retry Classifier Priority so that regardless of whether they are set during config or operation construction, they'll always run in a consistent order. Classifiers are each run in turn by the retry strategy: pub fn run_classifiers_on_ctx( classifiers: impl Iterator<Item = SharedRetryClassifier>, ctx: &InterceptorContext,
) -> RetryAction { // By default, don't retry let mut result = RetryAction::NoActionIndicated; for classifier in classifiers { let new_result = classifier.classify_retry(ctx); // If the result is `NoActionIndicated`, continue to the next classifier // without overriding any previously-set result. if new_result == RetryAction::NoActionIndicated { continue; } // Otherwise, set the result to the new result. tracing::trace!( "Classifier '{}' set the result of classification to '{}'", classifier.name(), new_result ); result = new_result; // If the result is `RetryForbidden`, stop running classifiers. if result == RetryAction::RetryForbidden { tracing::trace!("retry classification ending early because a `RetryAction::RetryForbidden` was emitted",); break; } } result
} NOTE: User-defined retry strategies are responsible for calling run_classifiers_on_ctx. Lower-priority classifiers run first, but the retry actions they return may be overridden by higher-priority classifiers. Classification stops immediately if any classifier returns RetryAction::RetryForbidden.

