#[derive(Debug)]
struct CustomRetryClassifier; impl ClassifyRetry for CustomRetryClassifier { fn classify_retry( &self, ctx: &InterceptorContext, ) -> Option<RetryAction> { // Check for a result let output_or_error = ctx.output_or_error(); // Check for an error let error = match output_or_error { // Typically, when the response is OK or unset // then `RetryAction::NoActionIndicated` is returned. Some(Ok(_)) | None => return RetryAction::NoActionIndicated, Some(Err(err)) => err, }; todo!("inspect the error to determine if a retry attempt should be made.") } fn name(&self) -> &'static str { "my custom retry classifier" } fn priority(&self) -> RetryClassifierPriority { RetryClassifierPriority::default() }
} Choosing a retry classifier priority Sticking with the default priority is often the best choice. Classifiers should restrict the number of cases they can handle in order to avoid having to compete with other classifiers. When two classifiers would classify a response in two different ways, the priority system gives us the ability to decide which classifier should be respected. Internally, priority is implemented with a simple numeric system. In order to give the smithy-rs team the flexibility to make future changes, this numeric system is private and inaccessible to users. Instead, users may set the priority of classifiers relative to one another with the with_lower_priority_than and with_higher_priority_than methods: impl RetryClassifierPriority { /// Create a new `RetryClassifierPriority` with lower priority than the given priority. pub fn with_lower_priority_than(other: Self) -> Self { ... } /// Create a new `RetryClassifierPriority` with higher priority than the given priority. pub fn with_higher_priority_than(other: Self) -> Self { ... }
} For example, if it was important for our CustomRetryClassifier in the previous example to run before the default HttpStatusCodeClassifier, a user would define the CustomRetryClassifier priority like this: impl ClassifyRetry for CustomRetryClassifier { fn priority(&self) -> RetryClassifierPriority { RetryClassifierPriority::run_before(RetryClassifierPriority::http_status_code_classifier()) }
} The priorities of the three default retry classifiers (HttpStatusCodeClassifier, ModeledAsRetryableClassifier, and TransientErrorClassifier) are all public for this purpose. Users may ONLY set a retry priority relative to an existing retry priority. RetryAction and RetryReason Retry classifiers communicate to the retry strategy by emitting RetryActions: /// The result of running a [`ClassifyRetry`] on a [`InterceptorContext`].
#[non_exhaustive]
#[derive(Clone, Eq, PartialEq, Debug, Default)]
pub enum RetryAction { /// When a classifier can't run or has no opinion, this action is returned. /// /// For example, if a classifier requires a parsed response and response parsing failed, /// this action is returned. If all classifiers return this action, no retry should be /// attempted. #[default] NoActionIndicated, /// When a classifier runs and thinks a response should be retried, this action is returned. RetryIndicated(RetryReason), /// When a classifier runs and decides a response must not be retried, this action is returned. /// /// This action stops retry classification immediately, skipping any following classifiers. RetryForbidden,
} When a retry is indicated by a classifier, the action will contain a RetryReason: /// The reason for a retry.
#[non_exhaustive]
#[derive(Clone, Eq, PartialEq, Debug)]
pub enum RetryReason { /// When an error is received that should be retried, this reason is returned. RetryableError { /// The kind of error. kind: ErrorKind, /// A server may tell us to retry only after a specific time has elapsed. retry_after: Option<Duration>, },
} NOTE: RetryReason currently only has a single variant, but it's defined as an enum for forward compatibility purposes. RetryAction's impl defines several convenience methods: impl RetryAction { /// Create a new `RetryAction` indicating that a retry is necessary. pub fn retryable_error(kind: ErrorKind) -> Self { Self::RetryIndicated(RetryReason::RetryableError { kind, retry_after: None, }) } /// Create a new `RetryAction` indicating that a retry is necessary after an explicit delay. pub fn retryable_error_with_explicit_delay(kind: ErrorKind, retry_after: Duration) -> Self { Self::RetryIndicated(RetryReason::RetryableError { kind, retry_after: Some(retry_after), }) } /// Create a new `RetryAction` indicating that a retry is necessary because of a transient error. pub fn transient_error() -> Self { Self::retryable_error(ErrorKind::TransientError) } /// Create a new `RetryAction` indicating that a retry is necessary because of a throttling error. pub fn throttling_error() -> Self { Self::retryable_error(ErrorKind::ThrottlingError) } /// Create a new `RetryAction` indicating that a retry is necessary because of a server error. pub fn server_error() -> Self { Self::retryable_error(ErrorKind::ServerError) } /// Create a new `RetryAction` indicating that a retry is necessary because of a client error. pub fn client_error() -> Self { Self::retryable_error(ErrorKind::ClientError) }
}

