In the current version of the SDK, users match the Unhandled variant. They can then read the code from the Unhandled variant because Unhandled implements the ProvideErrorMetadata trait as well as the standard-library std::error::Error trait. Note: It's possible to write correct code today because the operation-level and service-level errors already expose code() via ProvideErrorMetadata. This RFC describes mechanisms to guide customers to write forward-compatible code. # fn docs() { match client.get_object().send().await { Ok(obj) => { ... }, Err(e) => match e.into_service_error() { GetObjectError::NotFound => { ... }, GetObjectError::Unhandled(err) if err.code() == "ValidationException" => { ... } other => { /** do something with this variant */ } } }
# } We must instead guide customers into the following pattern: # fn docs() { match client.get_object().send().await { Ok(obj) => { ... }, Err(e) => match e.into_service_error() { GetObjectError::NotFound => { ... }, err if err.code() == "ValidationException" => { ... }, err => warn!("{}", err.code()), } }
# } In this example, because customers are not matching on the Unhandled variant explicitly this code is forward compatible for ValidationException being introduced in the future. Guiding Customers to this Pattern There are two areas we need to handle: Prevent customers from extracting useful information from Unhandled Alert customers currently using unhandled what to use instead. For example, the following code is still problematic: match err { GetObjectError::NotFound => { ... }, err @ GetObject::Unhandled(_) if err.code() == Some("ValidationException") => { ... } } For 1, we need to remove the ProvideErrorMetadata trait implementation from Unhandled. We would expose this isntead through a layer of indirection to enable code generated to code to still read the data. For 2, we would deprecate the Unhandled variants with a message clearly indicating how this code should be written.

