All interactions between the SDK and a service are modeled as "operations" . Operations contain: A base HTTP request (with a potentially streaming body) A typed property bag of configuration options A fully generic response handler Users create operations piecemeal with a fluent builder. The options set in the builder are then used to create the inner HTTP request, becoming headers or triggering specific request-building functionality (In this case, calculating a checksum and attaching it either as a header or a trailer.) Here's an example from the QLDB SDK of creating a body from inputs and inserting it into the request to be sent: let body = aws_smithy_http::body::SdkBody::from( crate::operation_ser::serialize_operation_crate_operation_send_command(&self)?,
); if let Some(content_length) = body.content_length() { request = aws_smithy_http::header::set_request_header_if_absent( request, http::header::CONTENT_LENGTH, content_length, );
}
let request = request.body(body).expect("should be valid request"); Most all request body creation in the SDKs looks like that. Note how it automatically sets the Content-Length header whenever the size of the body is known; It'll be relevant later. The body is read into memory and can be inspected before the request is sent. This allows for things like calculating a checksum and then inserting it into the request as a header.

