Often, sending a request with a streaming body looks much the same. However, it's not possible to read a streaming body until you've sent the request. Any metadata that needs to be calculated by inspecting the body must be sent as trailers. Additionally, some metadata, like Content-Length, can't be sent as a trailer at all. MDN maintains a helpful list of metadata that can only be sent as a header. // When trailers are set, we must send an AWS-specific header that lists them named `x-amz-trailer`.
// For example, when sending a SHA256 checksum as a trailer,
// we have to send an `x-amz-trailer` header telling the service to watch out for it:
request .headers_mut() .insert( http::header::HeaderName::from_static("x-amz-trailer"), http::header::HeaderValue::from_static("x-amz-checksum-sha256"), );

