In designing the orchestrator, we sought to solve the problems we had with the original smithy client. The client made heavy use of generics, allowing for increased performance, but at the cost of increased maintenance burden and increased compile times . The Rust compiler, usually very helpful, isn't well-equipped to explain trait errors when bounds are this complex, and so the resulting client was difficult to extend. Trait aliases would have helped, but they're not (at the time of writing) available. The type signatures for the old client and its call method: impl<C, M, R> Client<C, M, R>
where C: bounds::SmithyConnector, M: bounds::SmithyMiddleware<C>, R: retry::NewRequestPolicy,
{ pub async fn call<O, T, E, Retry>(&self, op: Operation<O, Retry>) -> Result<T, SdkError<E>> where O: Send + Sync, E: std::error::Error + Send + Sync + 'static, Retry: Send + Sync, R::Policy: bounds::SmithyRetryPolicy<O, T, E, Retry>, Retry: ClassifyRetry<SdkSuccess<T>, SdkError<E>>, bounds::Parsed<<M as bounds::SmithyMiddleware<C>>::Service, O, Retry>: Service<Operation<O, Retry>, Response=SdkSuccess<T>, Error=SdkError<E>> + Clone, { self.call_raw(op).await.map(|res| res.parsed) } pub async fn call_raw<O, T, E, Retry>( &self, op: Operation<O, Retry>, ) -> Result<SdkSuccess<T>, SdkError<E>> where O: Send + Sync, E: std::error::Error + Send + Sync + 'static, Retry: Send + Sync, R::Policy: bounds::SmithyRetryPolicy<O, T, E, Retry>, Retry: ClassifyRetry<SdkSuccess<T>, SdkError<E>>, // This bound is not _technically_ inferred by all the previous bounds, but in practice it // is because _we_ know that there is only implementation of Service for Parsed // (ParsedResponseService), and it will apply as long as the bounds on C, M, and R hold, // and will produce (as expected) Response = SdkSuccess<T>, Error = SdkError<E>. But Rust // doesn't know that -- there _could_ theoretically be other implementations of Service for // Parsed that don't return those same types. So, we must give the bound. bounds::Parsed<<M as bounds::SmithyMiddleware<C>>::Service, O, Retry>: Service<Operation<O, Retry>, Response=SdkSuccess<T>, Error=SdkError<E>> + Clone, { // The request/response lifecycle }
} The type signature for the new orchestrate method: pub async fn orchestrate( input: Input, runtime_plugins: &RuntimePlugins, // Currently, SdkError is HTTP-only. We currently use it for backwards-compatibility purposes. // The `HttpResponse` generic will likely be removed in the future.
) -> Result<Output, SdkError<Error, HttpResponse>> { // The request/response lifecycle
} Wait a second, I hear you ask. "I see an Input and Output there, but you're not declaring any generic type arguments. What gives?" I'm glad you asked. Generally, when you need traits, but you aren't willing to use generic type arguments, then you must Box . Polymorphism is achieved through dynamic dispatch instead of static dispatch , and this comes with a small runtime cost. So, what are Input and Output? They're our own special flavor of a boxed trait object. pub type Input = TypeErasedBox;
pub type Output = TypeErasedBox;
pub type Error = TypeErasedBox; /// A new-type around `Box<dyn Any + Send + Sync>`
#[derive(Debug)]
pub struct TypeErasedBox { inner: Box<dyn Any + Send + Sync>,
} The orchestrator itself doesn't know about any concrete types. Instead, it passes boxed data between the various components of the request/response lifecycle. Individual components access data in two ways: From the ConfigBag: (with an accessor) let retry_strategy = cfg.retry_strategy(); (with the get method) let retry_strategy = cfg.get::<Box<dyn RetryStrategy>>() From the InterceptorContext: (owned) let put_object_input: PutObjectInput = ctx.take_input().unwrap().downcast().unwrap()?; (by reference) let put_object_input = ctx.input().unwrap().downcast_ref::<PutObjectInput>().unwrap(); Users can only call ConfigBag::get or downcast a TypeErasedBox to types they have access to, which allows maintainers to ensure encapsulation. For example: a plugin writer may declare a private type, place it in the config bag, and then later retrieve it. Because the type is private, only code in the same crate/module can ever insert or retrieve it. Therefore, there's less worry that someone will depend on a hidden, internal detail and no worry they'll accidentally overwrite a type in the bag. NOTE: When inserting values into a config bag, using one of the set_<component> methods is always preferred, as this prevents mistakes related to inserting similar, but incorrect types.

