Smithy Rust is built on top of tower . Tower is a library of modular and reusable components for building robust networking clients and servers. The tower library is centered around two main interfaces, the Service trait and the Layer trait. The Service trait can be thought of as an asynchronous function from a request to a response, async fn(Request) -> Result<Response, Error>, coupled with a mechanism to handle back pressure , while the Layer trait can be thought of as a way of decorating a Service, transforming either the request or response. Middleware in tower typically conforms to the following pattern, a Service implementation of the form pub struct NewService<S> { inner: S, /* auxillary data */
} and a complementary # extern crate tower;
# pub struct NewService<S> { inner: S }
use tower::{Layer, Service}; pub struct NewLayer { /* auxiliary data */
} impl<S> Layer<S> for NewLayer { type Service = NewService<S>; fn layer(&self, inner: S) -> Self::Service { NewService { inner, /* auxiliary fields */ } }
} The NewService modifies the behavior of the inner Service S while the NewLayer takes auxiliary data and constructs NewService<S> from S. Customers are then able to stack middleware by composing Layers using combinators such as ServiceBuilder::layer and Stack .

