where S: Service<R>,
{ type Response = S::Response; type Error = S::Error; type Future = S::Future; fn poll_ready(&mut self, cx: &mut Context<'_>) -> Poll<Result<(), Self::Error>> { self.inner.poll_ready(cx) } fn call(&mut self, req: R) -> Self::Future { println!("Hi {} in {}", self.operation_id.name(), self.service_id.name()); self.inner.call(req) }
