A Smithy Rust server uses the tracing crate to provide instrumentation. The customer is responsible for setting up a Subscriber in order to ingest and process events - Smithy Rust makes no prescription on the choice of Subscriber. Common choices might include: tracing_subscriber::fmt for printing to stdout. tracing-log to providing compatibility with the log . Events are emitted and spans are opened by the aws-smithy-http-server, aws-smithy-http-server-python, and generated crate. The default target is always used The tracing macros default to using the module path where the span or event originated as the target, but it may be overridden. and therefore spans and events be filtered using the EnvFilter and/or Targets filters with crate and module paths. For example, RUST_LOG=aws_smithy_http_server=warn,aws_smithy_http_server_python=error and # extern crate tracing_subscriber;
# extern crate tracing;
