The service builder is the primary public API, generated for every Smithy Service . At a high-level, the service builder takes as input a function for each Smithy Operation and returns a single HTTP service. The signature of each function, also known as handlers , must match the constraints of the corresponding Smithy model. You can create an instance of a service builder by calling builder on the corresponding service struct. # extern crate aws_smithy_http_server;
# use aws_smithy_http_server::routing::Route;
/// The service builder for [`PokemonService`].
///
/// Constructed via [`PokemonService::builder`].
pub struct PokemonServiceBuilder<Body, HttpPl, ModelPl> { capture_pokemon_operation: Option<Route<Body>>, empty_operation: Option<Route<Body>>, get_pokemon_species: Option<Route<Body>>, get_server_statistics: Option<Route<Body>>, get_storage: Option<Route<Body>>, health_check_operation: Option<Route<Body>>, http_plugin: HttpPl, model_plugin: ModelPl,
} The builder has two setter methods for each Smithy Operation in the Smithy Service : pub fn get_pokemon_species<HandlerType, HandlerExtractors, UpgradeExtractors>(self, handler: HandlerType) -> Self where HandlerType:Handler<GetPokemonSpecies, HandlerExtractors>, ModelPl: Plugin< PokemonService, GetPokemonSpecies, IntoService<GetPokemonSpecies, HandlerType> >, UpgradePlugin::<UpgradeExtractors>: Plugin< PokemonService, GetPokemonSpecies, ModelPlugin::Output >, HttpPl: Plugin< PokemonService, GetPokemonSpecies, UpgradePlugin::<UpgradeExtractors>::Output >, { let svc = GetPokemonSpecies::from_handler(handler); let svc = self.model_plugin.apply(svc); let svc = UpgradePlugin::<UpgradeExtractors>::new() .apply(svc); let svc = self.http_plugin.apply(svc); self.get_pokemon_species_custom(svc) } pub fn get_pokemon_species_service<S, ServiceExtractors, UpgradeExtractors>(self, service: S) -> Self where S: OperationService<GetPokemonSpecies, ServiceExtractors>, ModelPl: Plugin< PokemonService, GetPokemonSpecies, Normalize<GetPokemonSpecies, S> >, UpgradePlugin::<UpgradeExtractors>: Plugin< PokemonService, GetPokemonSpecies, ModelPlugin::Output >, HttpPl: Plugin< PokemonService, GetPokemonSpecies, UpgradePlugin::<UpgradeExtractors>::Output >, { let svc = GetPokemonSpecies::from_service(service); let svc = self.model_plugin.apply(svc); let svc = UpgradePlugin::<UpgradeExtractors>::new().apply(svc); let svc = self.http_plugin.apply(svc); self.get_pokemon_species_custom(svc) } pub fn get_pokemon_species_custom<S>(mut self, svc: S) -> Self where S: Service<Request<Body>, Response = Response<BoxBody>, Error = Infallible>, { self.get_pokemon_species = Some(Route::new(svc)); self } Handlers and operations are upgraded to a Route as soon as they are registered against the service builder. You can think of Route as a boxing layer in disguise. You can transform a builder instance into a complete service (PokemonService) using one of the following methods: build. The transformation fails if one or more operations do not have a registered handler; build_unchecked. The transformation never fails, but we return 500s for all operations that do not have a registered handler. Both builder methods take care of: Pair each handler with the routing information for the corresponding operation; Collect all (routing_info, handler) pairs into a Router; Transform the Router implementation into a HTTP service via RouterService; Wrap the RouterService in a newtype given by the service name, PokemonService. The final outcome, an instance of PokemonService, looks roughly like this: # extern crate aws_smithy_http_server;
# use aws_smithy_http_server::{routing::RoutingService, protocol::rest_json_1::{router::RestRouter, RestJson1}};
/// The Pokmon Service allows you to retrieve information about Pokmon species.
#[derive(Clone)]
pub struct PokemonService<S> { router: RoutingService<RestRouter<S>, RestJson1>,
} The following schematic summarizes the composition: stateDiagram-v2 state in &lt;&lt;fork&gt;&gt; state "GetPokemonSpecies" as C1 state "GetStorage" as C2 state "DoNothing" as C3 state "..." as C4 direction LR [*] --&gt; in : HTTP Request UpgradePlugin --&gt; [*]: HTTP Response state PokemonService { state RoutingService { in --&gt; UpgradePlugin: HTTP Request in --&gt; C2: HTTP Request in --&gt; C3: HTTP Request in --&gt; C4: HTTP Request state C1 { state HttpPlugin { state UpgradePlugin { direction LR [*] --&gt; S: Model Input S --&gt; [*] : Model Output state ModelPlugin { S } } } } C2 C3 C4 } } C2 --&gt; [*]: HTTP Response C3 --&gt; [*]: HTTP Response C4 --&gt; [*]: HTTP Response

