An additional omitted detail is that we provide an "escape hatch" allowing Handlers and OperationServices to accept data that isn't modelled. In addition to accepting Op::Input they can accept additional arguments which implement the FromParts trait: # extern crate aws_smithy_http_server;
# extern crate http;
# use http::request::Parts;
# use aws_smithy_http_server::response::IntoResponse;
/// Provides a protocol aware extraction from a [`Request`]. This borrows the
/// [`Parts`], in contrast to [`FromRequest`].
pub trait FromParts<Protocol>: Sized { /// The type of the failures yielded extraction attempts. type Rejection: IntoResponse<Protocol>; /// Extracts `self` from a [`Parts`] synchronously. fn from_parts(parts: &mut Parts) -> Result<Self, Self::Rejection>;
}
# use aws_smithy_http_server::request::FromParts as FP;
# impl<P, T: FP<P>> FromParts<P> for T {
# type Rejection = <T as FP<P>>::Rejection;
# fn from_parts(parts: &mut Parts) -> Result<Self, Self::Rejection> { <T as FP<P>>::from_parts(parts) }
# } This differs from FromRequest trait, introduced in Serialization and Deserialization , as it's synchronous and has non-consuming access to Parts , rather than the entire Request . pub struct Parts { pub method: Method, pub uri: Uri, pub version: Version, pub headers: HeaderMap<HeaderValue>, pub extensions: Extensions, /* private fields */
} This is commonly used to access types stored within Extensions which have been inserted by a middleware. An Extension struct implements FromParts to support this use case: # extern crate aws_smithy_http_server;
# extern crate http;
# extern crate thiserror;
# use aws_smithy_http_server::{body::BoxBody, request::FromParts, response::IntoResponse};
# use http::status::StatusCode;
# use thiserror::Error;
# fn empty() -> BoxBody { todo!() }
/// Generic extension type stored in and extracted from [request extensions].
///
/// This is commonly used to share state across handlers.
///
/// If the extension is missing it will reject the request with a `500 Internal
/// Server Error` response.
///
/// [request extensions]: https://docs.rs/http/latest/http/struct.Extensions.html
#[derive(Debug, Clone)]
pub struct Extension<T>(pub T); impl<Protocol, T> FromParts<Protocol> for Extension<T>
where T: Clone + Send + Sync + 'static,
{ type Rejection = MissingExtension; fn from_parts(parts: &mut http::request::Parts) -> Result<Self, Self::Rejection> { parts.extensions.remove::<T>().map(Extension).ok_or(MissingExtension) }
} /// The extension has not been added to the [`Request`](http::Request) or has been previously removed.
#[derive(Debug, Error)]
#[error("the `Extension` is not present in the `http::Request`")]
pub struct MissingExtension; impl<Protocol> IntoResponse<Protocol> for MissingExtension { fn into_response(self) -> http::Response<BoxBody> { let mut response = http::Response::new(empty()); *response.status_mut() = StatusCode::INTERNAL_SERVER_ERROR; response }
}
